B.SS=new A.d(B.c,["\u0938\u0930\u094d\u0935\u0947\u092a\u093f \u090f\u0924\u0947 \u092f\u091c\u094d\u091e\u0935\u093f\u0926\u094b \u092f\u091c\u094d\u091e \u0915\u094d\u0937\u092a\u093f\u0924 \u0915\u0932\u094d\u092e\u0937\u093e\u0903 \u0965 \u0969\u0966 \u0965\n\u092f\u091c\u094d\u091e \u0936\u093f\u0937\u094d\u091f\u093e\u092e\u0943\u0924 \u092d\u0941\u091c\u094b \u092f\u093e\u0928\u094d\u0924\u093f \u092c\u094d\u0930\u0939\u094d\u092e \u0938\u0928\u093e\u0924\u0928\u092e\u094d \u0964","All these people know about worship. By worshiping, they have been rid of their faults. They sustain their bodies using the residue of worship. They will reach the ever-present Lord."],t.w)
B.V9=new A.d(B.c,["\u0928\u093e\u092f\u092e\u094d \u0932\u094b\u0915\u094b\u093d\u0938\u094d\u0924\u093f \u0905\u092f\u091c\u094d\u091e\u0938\u094d\u092f \u0915\u0941\u0924\u094b\u093d\u0928\u094d\u092f\u0903 \u0915\u0941\u0930\u0941\u0938\u0924\u094d\u0924\u092e \u0965 \u0969\u0967 \u0965","Arjuna, even this material world is not for a person without worship. How can he achieve anything else?"],t.w)
B.UI=new A.d(B.c,["\u090f\u0935\u092e\u094d \u092c\u0939\u0941\u0935\u093f\u0927\u093e \u092f\u091c\u094d\u091e\u093e \u0935\u093f\u0924\u0924\u093e \u092c\u094d\u0930\u0939\u094d\u092e\u0923\u094b \u092e\u0941\u0916\u0947 \u0964\n\u0915\u0930\u094d\u092e\u091c\u093e\u0928\u094d \u0935\u093f\u0926\u094d\u0927\u093f \u0924\u093e\u0928\u094d \u0938\u0930\u094d\u0935\u093e\u0928\u094d \u090f\u0935\u092e\u094d \u091c\u094d\u091e\u093e\u0924\u094d\u0935\u093e \u0935\u093f\u092e\u094b\u0915\u094d\u0937\u094d\u092f\u0938\u0947 \u0965 \u0969\u0968 \u0965","In this way, many varieties of worship were elaborated as ways in which we can realize the Self. Know them all to be born out of activity. Knowing this, you will attain Moksha ."],t.w)
B.LM=new A.d(B.c,["\u0936\u094d\u0930\u0947\u092f\u093e\u0928\u094d \u0926\u094d\u0930\u0935\u094d\u092f \u092e\u092f\u093e\u0924\u094d \u092f\u091c\u094d\u091e\u093e\u0924\u094d \u091c\u094d\u091e\u093e\u0928\u092f\u091c\u094d\u091e\u0903 \u092a\u0930\u0928\u094d\u0924\u092a \u0964\n\u0938\u0930\u094d\u0935\u092e\u094d \u0915\u0930\u094d\u092e\u093e\u0916\u093f\u0932\u092e\u094d \u092a\u093e\u0930\u094d\u0925 \u091c\u094d\u091e\u093e\u0928\u0947 \u092a\u0930\u093f\u0938\u092e\u093e\u092a\u094d\u092f\u0924\u0947 \u0965 \u0969\u0969 \u0965","Arjuna, the knowledge embedded in worship is more significant than worship that\u2019s full of material offerings. Arjuna, every activity, without exception, culminates in knowledge."],t.w)
B.TA=new A.d(B.c,["\u0924\u0926\u094d\u0935\u093f\u0926\u094d\u0927\u093f \u092a\u094d\u0930\u0923\u093f\u092a\u093e\u0924\u0947\u0928 \u092a\u0930\u093f\u092a\u094d\u0930\u0936\u094d\u0928\u0947\u0928 \u0938\u0947\u0935\u092f\u093e \u0964\n\u0909\u092a\u0926\u0947\u0915\u094d\u0937\u094d\u092f\u0928\u094d\u0924\u093f \u0924\u0947 \u091c\u094d\u091e\u093e\u0928\u092e\u094d \u091c\u094d\u091e\u093e\u0928\u093f\u0928\u0903 \u0924\u0924\u094d\u0924\u094d\u0935 \u0926\u0930\u094d\u0936\u093f\u0928\u0903 \u0965 \u0969\u096a \u0965","Know this by surrendering, by cross questioning, by rendering service and by listening to a teacher. Those who know and show the way will preach this knowledge to you."],t.w)
B.QW=new A.d(B.c,["\u092f\u0924\u094d \u091c\u094d\u091e\u093e\u0924\u094d\u0935\u093e \u0928 \u092a\u0941\u0928\u0930\u094d\u092e\u094b\u0939\u092e\u094d \u090f\u0935\u092e\u094d \u092f\u093e\u0938\u094d\u092f\u0938\u093f \u092a\u093e\u0928\u094d\u0926\u0935 \u0964\n\u092f\u0947\u0928 \u092d\u0942\u0924\u093e\u0928\u094d\u092f\u0936\u0947\u0937\u0947\u0923 \u0926\u094d\u0930\u0915\u094d\u0937\u094d\u092f\u0938\u093f \u0906\u0924\u094d\u092e\u0928\u094d\u092f\u0925\u094b \u092e\u092f\u093f \u0965 \u0969\u096b \u0965","Arjuna, after knowing this, you will never be confused in this way again. With this knowledge, you will see all beings, without exception within your Self, and then in Me."],t.w)
B.PL=new A.d(B.c,["\u0905\u092a\u093f \u091a\u0947\u0926\u0938\u093f \u092a\u093e\u092a\u0947\u092d\u094d\u092f\u0903 \u0938\u0930\u094d\u0935\u0947\u092d\u094d\u092f\u0903 \u092a\u093e\u092a\u0915\u0943\u0924\u094d\u0924\u092e\u0903 \u0964\n\u0938\u0930\u094d\u0935\u092e\u094d \u091c\u094d\u091e\u093e\u0928\u092a\u094d\u0932\u0935\u0947\u0928\u0948\u0935 \u0935\u0943\u091c\u093f\u0928\u092e\u094d \u0938\u0928\u094d\u0924\u0930\u093f\u0937\u094d\u092f\u0938\u093f \u0965 \u0969\u096c \u0965","Even if you are the most miserable among all those who have done wrong, you will cross over all the misery by the boat of knowledge alone."],t.w)
B.LY=new A.d(B.c,["\u092f\u0925\u0948\u0927\u093e\u092e\u094d\u0938\u093f \u0938\u092e\u093f\u0926\u094d\u0927\u094b\u0917\u094d\u0928\u093f\u0903 \u092d\u0938\u094d\u092e\u0938\u093e\u0924\u094d \u0915\u0941\u0930\u0941\u0924\u0947\u093d\u0930\u094d\u091c\u0941\u0928 \u0964\n\u091c\u094d\u091e\u093e\u0928\u093e\u0917\u094d\u0928\u093f\u0903 \u0938\u0930\u094d\u0935\u0915\u0930\u094d\u092e\u093e\u0923\u093f \u092d\u0938\u094d\u092e\u0938\u093e\u0924\u094d \u0915\u0941\u0930\u0941\u0924\u0947 \u0924\u0925\u093e \u0965 \u0969\u096d \u0965","Arjuna, just as a well-burning fire annihilates fuel, in the same way, the fire of knowledge will burn down all your past actions."],t.w)
B.MY=new A.d(B.c,["\u0928 \u0939\u093f \u091c\u094d\u091e\u093e\u0928\u0947\u0928 \u0938\u0926\u0943\u0936\u092e\u094d \u092a\u0935\u093f\u0924\u094d\u0930\u092e\u093f\u0939 \u0935\u093f\u0926\u094d\u092f\u0924\u0947 \u0964\n\u0924\u0924\u094d\u0938\u094d\u0935\u092f\u092e\u094d \u092f\u094b\u0917\u0938\u092e\u094d\u0938\u093f\u0926\u094d\u0927\u0903 \u0915\u093e\u0932\u0947\u0928\u093e\u0924\u094d\u092e\u0928\u093f \u0935\u093f\u0928\u094d\u0926\u0924\u093f \u0965 \u0969\u096e \u0965","There is nothing in this world, which is equal to knowledge in its flawlessness. A person who has attained maturity by working without being driven by attachments will find that knowledge in his own Self, over time."],t.w)
B.N7=new A.d(B.c,["\u0936\u094d\u0930\u0926\u094d\u0927\u093e\u0935\u093e\u0928\u094d \u0932\u092d\u0924\u0947 \u091c\u094d\u091e\u093e\u0928\u092e\u094d \u0924\u0924\u094d\u092a\u0930\u0903 \u0938\u092e\u094d\u092f\u0924\u0947\u0928\u094d\u0926\u094d\u0930\u093f\u092f\u0903 \u0964\n\u091c\u094d\u091e\u093e\u0928\u092e\u094d \u0932\u092c\u094d\u0927\u094d\u0935\u093e \u092a\u0930\u093e\u092e\u094d \u0936\u093e\u0928\u094d\u0924\u093f\u092e\u094d \u0905\u091a\u093f\u0930\u0947\u0923\u093e\u0927\u093f\u0917\u091a\u094d\u091b\u0924\u093f \u0965 \u0969\u096f \u0965","A person who trusts, is eagerly engaged and has his sense organs under control will obtain knowledge. Having obtained this knowledge, he will quickly attain the ultimate composure."],t.w)
B.PI=new A.d(B.c,["\u0905\u091c\u094d\u091e\u0936\u094d\u091a \u0905\u0936\u094d\u0930\u0926\u094d\u0926\u0927\u093e\u0928\u0936\u094d\u091a \u0938\u092e\u094d\u0936\u092f\u093e\u0924\u094d\u092e\u093e \u0935\u093f\u0928\u0936\u094d\u092f\u0924\u093f \u0964\n\u0928\u093e\u092f\u092e\u094d \u0932\u094b\u0915\u094b\u093d\u0938\u094d\u0924\u093f \u0928 \u092a\u0930\u094b \u0928 \u0938\u0941\u0916\u092e\u094d \u0938\u092e\u094d\u0936\u092f\u093e\u0924\u094d\u092e\u0928\u0903 \u0965 \u096a\u0966 \u0965","A person without this knowledge, who has suspicion in his mind and is not dedicated will perish. He is not eligible for anything in this world nor in any other world."],t.w)
B.Ty=new A.d(B.c,["\u092f\u094b\u0917 \u0938\u0902\u0928\u094d\u092f\u0938\u094d\u0924 \u0915\u0930\u094d\u092e\u093e\u0923\u092e\u094d \u091c\u094d\u091e\u093e\u0928 \u0938\u0928\u094d\u091b\u093f\u0928\u094d\u0928 \u0938\u092e\u094d\u0936\u092f\u092e\u094d \u0964\n\u0906\u0924\u094d\u092e\u0935\u0928\u094d\u0924\u092e\u094d \u0928 \u0915\u0930\u094d\u092e\u093e\u0923\u093f \u0928\u093f\u092c\u0927\u094d\u0928\u0928\u094d\u0924\u093f \u0927\u0928\u0928\u094d\u091c\u092f \u0965 \u096a\u0967 \u0965","Arjuna, activities do not limit a person who is free from possessiveness towards his work. With the knowledge of the Self, such a person is rid of doubts and stays focused on the Self."],t.w)
B.MI=new A.d(B.c,["\u0924\u0938\u094d\u092e\u093e\u0924\u094d \u0905\u091c\u094d\u091e\u093e\u0928 \u0938\u092e\u094d\u092d\u0942\u0924\u092e\u094d \u0939\u0943\u0924\u094d\u0938\u094d\u0925\u092e\u094d \u091c\u094d\u091e\u093e\u0928\u093e\u0938\u093f\u0928\u093e\u0924\u094d\u092e\u0928\u0903 \u0964\n\u091b\u093f\u0924\u094d\u0935\u0948\u0928\u092e\u094d \u0938\u092e\u094d\u0936\u092f\u092e\u094d \u092f\u094b\u0917\u092e\u093e\u0925\u093f\u0937\u094d\u0920 \u0909\u0924\u094d\u0924\u093f\u0937\u094d\u0920 \u092d\u093e\u0930\u0924 \u0965 \u096a\u0968 \u0965","Arjuna, that\u2019s why you must cut off this suspicion, which has taken its place in your heart due to ignorance. Cut it off using the knowledge of the Self as a sword. Having done this, follow the path of working without being driven by attachments and get up."],t.w)
B.ND=new A.d(B.c,["\u0905\u0930\u094d\u091c\u0941\u0928 \u0909\u0935\u093e\u091a -\n\u0938\u0902\u0928\u094d\u092f\u093e\u0938\u092e\u094d \u0915\u0930\u094d\u092e\u0923\u093e\u092e\u094d \u0915\u0943\u0937\u094d\u0923 \u092a\u0941\u0928\u0930\u094d\u092f\u094b\u0917\u092e\u094d \u091a \u0936\u092e\u094d\u0938\u0938\u093f \u0964\n\u092f\u091a\u094d\u091b\u094d\u0930\u0947\u092f \u090f\u0924\u092f\u094b\u0930\u0947\u0915\u092e\u094d \u0924\u0928\u094d\u092e\u0947 \u092c\u094d\u0930\u0942\u0939\u093f \u0938\u0941\u0928\u093f\u0936\u094d\u091a\u093f\u0924\u092e\u094d \u0965 \u0967 \u0965","Arjuna says: O Krishna, You recommend giving up actions. You also recommend determined and skillful action, without being driven by attachments. Among these two paths, which one is preferred? Tell that to me clearly."],t.w)
B.PV=new A.d(B.c,["\u0936\u094d\u0930\u0940 \u092d\u0917\u0935\u093e\u0928\u094d \u0909\u0935\u093e\u091a -\n\u0938\u0902\u0928\u094d\u092f\u093e\u0938\u0903 \u0915\u0930\u094d\u092e\u092f\u094b\u0917\u0936\u094d\u091a \u0928\u093f\u0936\u094d\u0936\u094d\u0930\u0947\u092f \u0938\u0915\u0930\u094c \u0909\u092d\u094c \u0964\n\u0924\u092f\u094b\u0938\u094d\u0924\u0941 \u0915\u0930\u094d\u092e \u0938\u0902\u0928\u094d\u092f\u093e\u0938\u093e\u0924\u094d \u0915\u0930\u094d\u092e\u092f\u094b\u0917\u094b \u0935\u093f\u0936\u093f\u0937\u094d\u092f\u0924\u0947 \u0965 \u0968 \u0965","Lord Krishna said- Both techniques- giving up actions and working without being driven by attachments - lead to moksha . Among them, work that\u2019s not driven by desire stands out in preference to giving up work itself."],t.w)
B.SX=new A.d(B.c,["\u091c\u094d\u091e\u0947\u092f\u0903 \u0938 \u0928\u093f\u0924\u094d\u092f \u0938\u0902\u0928\u094d\u092f\u093e\u0938\u0940 \u092f\u094b \u0928 \u0926\u094d\u0935\u0947\u0937\u094d\u091f\u093f \u0928 \u0915\u093e\u0919\u094d\u0915\u094d\u0937\u0924\u093f \u0964\n\u0928\u093f\u0930\u094d\u0926\u094d\u0935\u0928\u094d\u0926\u094d\u0935\u094b \u0939\u093f \u092e\u0939\u093e\u092c\u093e\u0939\u094b \u0938\u0941\u0916\u092e\u094d \u092c\u0928\u094d\u0927\u093e\u0924\u094d \u092a\u094d\u0930\u092e\u0941\u091a\u094d\u092f\u0924\u0947 \u0965 \u0969 \u0965","Arjuna, The person who is not addicted to desires and is not carried away by hatred \u2013 he has overcome dualities. it is to be known, that he stays beyond desire. He alone is easily freed from the limitations of this world."],t.w)
B.V8=new A.d(B.c,["\u0938\u093e\u0919\u094d\u0916\u094d\u092f \u092f\u094b\u0917\u094c \u092a\u0943\u0925\u0915\u094d \u092c\u093e\u0932\u093e\u0903 \u092a\u094d\u0930\u0935\u0926\u0928\u094d\u0924\u093f \u0928 \u092a\u0928\u094d\u0926\u093f\u0924\u093e\u0903 \u0964\n\u090f\u0915\u092e\u094d \u0905\u092a\u094d\u092f\u093e\u0938\u094d\u0925\u093f\u0924\u0903 \u0938\u092e\u094d\u092f\u0915\u094d \u0909\u092d\u092f\u094b\u0930\u094d \u0935\u093f\u0928\u094d\u0926\u0924\u0947 \u092b\u0932\u092e\u094d \u0965 \u096a \u0965","Na\xefve people say that the two techniques \u2013 Knowing by contemplation and the technique of working independent of desire - are different in terms of the results they yield. Learned people do not say that. A person who properly practices any one among the two will obtain the result."],t.w)
B.N6=new A.d(B.c,["\u092f\u0924\u094d\u0938\u093e\u0919\u094d\u0916\u094d\u092f\u0948\u0903 \u092a\u094d\u0930\u093e\u092a\u094d\u092f\u0924\u0947 \u0938\u094d\u0925\u093e\u0928\u092e\u094d \u0924\u0924\u094d \u092f\u094b\u0917\u0948\u0930\u092a\u093f \u0917\u092e\u094d\u092f\u0924\u0947 \u0964\n\u090f\u0915\u092e\u094d \u0938\u093e\u0919\u094d\u0916\u094d\u092f\u092e\u094d \u091a \u092f\u094b\u0917\u092e\u094d \u091a \u092f\u0903 \u092a\u0936\u094d\u092f\u0924\u093f \u0938 \u092a\u0936\u094d\u092f\u0924\u093f \u0965 \u096b \u0965","The state of Self-realization gained by people who contemplate exclusively is also reached by people who work without being driven . The one who sees both of them as one is the person who realizes."],t.w)
B.Sy=new A.d(B.c,["\u0938\u0902\u0928\u094d\u092f\u093e\u0938\u0938\u094d\u0924\u0941 \u092e\u0939\u093e\u092c\u093e\u0939\u094b \u0926\u0941\u0903\u0916\u092e\u094d \u0906\u092a\u094d\u0924\u0941\u092e\u094d \u0905\u092f\u094b\u0917\u0924\u0903 \u0964\n\u092f\u094b\u0917\u092f\u0941\u0915\u094d\u0924\u094b \u092e\u0941\u0928\u093f\u0930\u094d \u092c\u094d\u0930\u0939\u094d\u092e \u0928 \u091a\u093f\u0930\u0947\u0923 \u0905\u0927\u093f\u0917\u091a\u094d\u091b\u0924\u093f \u0965 \u096c \u0965","Arjuna, giving up everything else to contemplate exclusively is extremely difficult to achieve without activity. A person who works without being driven by desire, who has the intention to realize the Self, will realize the true nature of the Self without delay."],t.w)
B.O2=new A.d(B.c,["\u092f\u094b\u0917\u092f\u0941\u0915\u094d\u0924\u094b \u0935\u093f\u0936\u0941\u0926\u094d\u0927\u093e\u0924\u094d\u092e\u093e \u0935\u093f\u091c\u093f\u0924\u093e\u0924\u094d\u092e\u093e \u091c\u093f\u0924\u0947\u0928\u094d\u0926\u094d\u0930\u093f\u092f\u0903 \u0964\n\u0938\u0930\u094d\u0935 \u092d\u0942\u0924\u093e\u0924\u094d\u092e \u092d\u0942\u0924\u093e\u0924\u094d\u092e\u093e \u0915\u0941\u0930\u094d\u0935\u0928\u094d\u0928\u092a\u093f \u0928 \u0932\u093f\u092a\u094d\u092f\u0924\u0947 \u0965 \u096d \u0965","A person who has dedicated himself to work without being driven by desire purifies himself, conquers his mind and keeps his organs under control. He considers the Self that\u2019s present in all beings as being equal to his own Self and is not stuck to anything, even though he keeps doing his work."],t.w)
B.TF=new A.d(B.c,["\u0928\u0948\u0935 \u0915\u093f\u0928\u094d\u091a\u093f\u0924\u094d \u0915\u0930\u094b\u092e\u0940\u0924\u093f \u092f\u0941\u0915\u094d\u0924\u094b \u092e\u0928\u094d\u092f\u0947\u0924 \u0924\u0924\u094d\u0935\u0935\u093f\u0924\u094d \u0964\n\u092a\u0936\u094d\u092f\u0928\u094d \u0936\u0943\u0923\u094d\u0935\u0928\u094d \u0938\u094d\u092a\u0943\u0936\u0928\u094d \u091c\u093f\u0918\u094d\u0930\u0928\u094d \u0905\u0936\u094d\u0928\u0928\u094d \u0917\u091a\u094d\u091b\u0928\u094d \u0938\u094d\u0935\u092a\u0928\u094d \u0936\u094d\u0935\u0938\u0928\u094d \u0965 \u096e \u0965\n\u092a\u094d\u0930\u0932\u092a\u0928\u094d \u0935\u093f\u0938\u0943\u091c\u0928\u094d \u0917\u0943\u0939\u094d\u0923\u0928\u094d \u0909\u0928\u094d\u092e\u093f\u0937\u0928\u094d \u0928\u093f\u092e\u093f\u0937\u0928\u094d\u0928\u092a\u093f \u0964\n\u0907\u0928\u094d\u0926\u094d\u0930\u093f\u092f\u093e\u0923\u093f \u0907\u0928\u094d\u0926\u094d\u0930\u093f\u092f\u093e\u0930\u094d\u0925\u0947\u0937\u0941 \u0935\u0930\u094d\u0924\u0928\u094d\u0924 \u0907\u0924\u093f \u0927\u093e\u0930\u092f\u0928\u094d \u0965 \u096f \u0965","A person who knows the nature of the Self, who has dedicated himself to worship to the Lord with activity will consider that his organs will remain among things that stimulate them, and knows that \u2018I do not do anything\u2019 while seeing, hearing, touching, smelling, eating, moving around, sleeping, breathing, talking, letting go, holding, when his eyes are open and when they are shut."],t.w)
B.TW=new A.d(B.c,["\u092c\u094d\u0930\u0939\u094d\u092e\u0923\u094d\u092f\u093e\u0927\u093e\u092f \u0915\u0930\u094d\u092e\u093e\u0923\u093f \u0938\u0919\u094d\u0917\u092e\u094d \u0924\u094d\u092f\u0915\u094d\u0924\u094d\u0935\u093e \u0915\u0930\u094b\u0924\u093f \u092f\u0903 \u0964\n\u0932\u093f\u092a\u094d\u092f\u0924\u0947 \u0928 \u0938 \u092a\u093e\u092a\u0947\u0928 \u092a\u0926\u094d\u092e \u092a\u0924\u094d\u0930\u092e\u094d \u0907\u0935\u093e\u092e\u094d\u092d\u0938\u093e \u0965 \u0967\u0966 \u0965","The person who places all deeds in nature itself and works while giving up all attachments is not bound by any fault, like a lotus leaf in water."],t.w)
B.QX=new A.d(B.c,["\u0915\u093e\u092f\u0947\u0928 \u092e\u0928\u0938\u093e \u092c\u0941\u0926\u094d\u0927\u094d\u092f\u093e \u0915\u0947\u0935\u0932\u0948\u0930\u093f\u0928\u094d\u0926\u094d\u0930\u093f\u092f\u0948\u0930\u092a\u093f \u0964\n\u092f\u094b\u0917\u093f\u0928\u0903 \u0915\u0930\u094d\u092e \u0915\u0941\u0930\u094d\u0935\u0928\u094d\u0924\u093f \u0938\u0919\u094d\u0917\u092e\u094d \u0924\u094d\u092f\u0915\u094d\u0924\u094d\u0935\u093e \u0906\u0924\u094d\u092e \u0936\u0941\u0926\u094d\u0927\u092f\u0947 \u0965 \u0967\u0967 \u0965","People who worship Me with their activities do their work using their bodies, their minds, their intellect or just with their organs, while giving up attachments to purify the Self."],t.w)
B.Nv=new A.d(B.c,["\u092f\u0941\u0915\u094d\u0924\u0903 \u0915\u0930\u094d\u092e \u092b\u0932\u092e\u094d \u0924\u094d\u092f\u0915\u094d\u0924\u094d\u0935\u093e \u0936\u093e\u0928\u094d\u0924\u093f\u092e\u094d \u0906\u092a\u094d\u0928\u094b\u0924\u093f \u0928\u0948\u0937\u094d\u0920\u093f\u0915\u0940\u092e\u094d \u0964\n\u0905\u092f\u0941\u0915\u094d\u0924\u0903 \u0915\u093e\u092e\u0915\u093e\u0930\u0947\u0923 \u092b\u0932\u0947 \u0938\u0915\u094d\u0924\u094b \u0928\u093f\u092c\u0927\u094d\u092f\u0924\u0947 \u0965 \u0967\u0968 \u0965","A person who is intent and engaged will give up the attachment to outcomes and will obtain the joy of experiencing the Self in its pure form. A person who does not do this is attached to the outcome of his activities. Being driven by desire, he is tied down to the stimuli of this world."],t.w)
B.RQ=new A.d(B.c,["\u0938\u0930\u094d\u0935 \u0915\u0930\u094d\u092e\u093e\u0923\u093f \u092e\u0928\u0938\u093e \u0938\u0902\u0928\u094d\u092f\u0938\u094d\u092f\u093e\u0938\u094d\u0924\u0947 \u0938\u0941\u0916\u092e\u094d \u0935\u0936\u0940 \u0964\n\u0928\u0935\u0926\u094d\u0935\u093e\u0930\u0947 \u092a\u0941\u0930\u0947 \u0926\u0947\u0939\u0940 \u0928\u0948\u0935 \u0915\u0941\u0930\u094d\u0935\u0928\u094d \u0928 \u0915\u093e\u0930\u092f\u0928\u094d \u0965 \u0967\u0969 \u0965","Having given up all actions in the city with nine gates (the body) using the mind, the Self, which is the owner of the body will control his organs and stay content without committing any action directly or indirectly."],t.w)
B.PF=new A.d(B.c,["\u0928 \u0915\u0930\u094d\u0924\u0943\u0924\u094d\u0935\u0935\u094d\u092e\u094d \u0928 \u0915\u0930\u094d\u092e\u093e\u0923\u093f \u0932\u094b\u0915\u0938\u094d\u092f \u0938\u0943\u091c\u0924\u093f \u092a\u094d\u0930\u092d\u0941\u0903 \u0964\n\u0928 \u0915\u0930\u094d\u092e \u092b\u0932 \u0938\u092e\u094d\u092f\u094b\u0917\u092e\u094d \u0938\u094d\u0935\u092d\u093e\u0935\u0938\u094d\u0924\u0941 \u092a\u094d\u0930\u0935\u0930\u094d\u0924\u0924\u0947 \u0965 \u0967\u096a \u0965","The Self does not create the impression of making things happen, an impression associated with this material world. Neither does it create the actions of this material world, nor the impression that outcomes are inseparably linked with these actions. The nature of this material world prevails."],t.w)
B.Ov=new A.d(B.c,["\u0928\u093e\u0926\u0924\u094d\u0924\u0947 \u0915\u0938\u094d\u092f\u091a\u093f\u0924\u094d \u092a\u093e\u092a\u092e\u094d \u0928 \u091a\u0948\u0935 \u0938\u0941\u0915\u0943\u0924\u092e\u094d \u0935\u093f\u092d\u0941\u0903 \u0964\n\u0905\u091c\u094d\u091e\u093e\u0928\u0947\u0928 \u0906\u0935\u0943\u0924\u092e\u094d \u091c\u094d\u091e\u093e\u0928\u092e\u094d \u0924\u0947\u0928 \u092e\u0941\u0939\u094d\u092f\u0928\u094d\u0924\u093f \u091c\u0928\u094d\u0924\u0935\u0903 \u0965 \u0967\u096b \u0965","The omnipresent Self does not take up anyone\u2019s sinful deeds. Nor does it take up any virtuous deeds. The inherent knowledge in the Self is concealed by ignorance. Due to this, the various beings are misled into believing that the body is their Self."],t.w)
B.Rs=new A.d(B.c,["\u091c\u094d\u091e\u093e\u0928\u0947\u0928 \u0924\u0941 \u0924\u0926\u094d \u0905\u091c\u094d\u091e\u093e\u0928\u092e\u094d \u092f\u0947\u0937\u093e\u092e\u094d \u0928\u093e\u0936\u093f\u0924\u092e\u094d \u0906\u0924\u094d\u092e\u0928\u0903 \u0964\n\u0924\u0947\u0937\u093e\u092e\u094d \u0906\u0926\u093f\u0924\u094d\u092f\u0935\u0924\u094d \u091c\u094d\u091e\u093e\u0928\u092e\u094d \u092a\u094d\u0930\u0915\u093e\u0936\u092f\u0924\u093f \u0924\u0924\u094d\u092a\u0930\u092e\u094d \u0965 \u0967\u096c \u0965","Knowledge shines like the sun in people whose ignorance is destroyed by the knowledge of the Self. This knowledge is their ultimate goal."],t.w)
B.RJ=new A.d(B.c,["\u0924\u0924\u094d \u092c\u0941\u0926\u094d\u0927\u092f\u0903 \u0924\u0926\u093e\u0924\u094d\u092e\u093e\u0928\u0903 \u0924\u0928\u094d\u0928\u093f\u0937\u094d\u0920\u093e\u0903 \u0924\u0924\u094d\u092a\u0930\u093e\u092f\u0923\u093e\u0903 \u0964\n\u0917\u091a\u094d\u091b\u0928\u094d\u0924\u093f \u0905\u092a\u0941\u0928\u0930\u093e\u0935\u0943\u0924\u094d\u0924\u093f\u092e\u094d \u091c\u094d\u091e\u093e\u0928 \u0928\u093f\u0930\u094d\u0927\u0942\u0924 \u0915\u0932\u094d\u092e\u0937\u093e\u0903 \u0965 \u0967\u096d \u0965","While being deprived of the state of ultimate knowledge, while being flawed, those who have dedicated their intellect, who dedicate their thoughts\u200b to fully believe in the goal, considering their goal to be supreme - they will reach that state, from which they will not fall again."],t.w)
B.UW=new A.d(B.c,["\u0935\u093f\u0926\u094d\u092f\u093e \u0935\u093f\u0928\u092f \u0938\u092e\u094d\u092a\u0928\u094d\u0928\u0947 \u092d\u093e\u0939\u094d\u092e\u0923\u0947 \u0917\u0935\u093f \u0939\u0938\u094d\u0924\u093f\u0928\u093f \u0964\n\u0936\u0941\u0928\u093f \u091a\u0948\u0935 \u0936\u094d\u0935\u092a\u093e\u0915\u0947 \u091a \u092a\u0928\u094d\u0926\u093f\u0924\u093e\u0903 \u0938\u092e \u0926\u0930\u094d\u0936\u093f\u0928\u0903 \u0965 \u0967\u096e \u0965","People who know the true nature of the Self see equality in a person who is endowed with knowledge and humility, in someone who is just a Brahmin, in a cow, in an elephant, even in a dog and even in a person who eats the meat of a dog."],t.w)
B.Nu=new A.d(B.c,["\u0907\u0939\u0948\u0935 \u0924\u0948\u0930\u094d\u091c\u093f\u0924\u0903 \u0938\u0930\u094d\u0917\u0903 \u092f\u0947\u0937\u093e\u092e\u094d \u0938\u093e\u092e\u094d\u092f\u0947 \u0938\u094d\u0925\u093f\u0924\u092e\u094d \u092e\u0928\u0903 \u0964\n\u0928\u093f\u0930\u094d\u0926\u094b\u0937\u092e\u094d \u0939\u093f \u0938\u092e\u092e\u094d \u092c\u094d\u0930\u0939\u094d\u092e \u0924\u0938\u094d\u092e\u093e\u0924\u094d \u092c\u094d\u0930\u0939\u094d\u092e\u0923\u093f \u0924\u0947 \u0938\u094d\u0925\u093f\u0924\u093e\u0903 \u0965 \u0967\u096f \u0965","This material creation has been conquered here itself, by those whose minds are situated in this equality. When devoid of faults, the Self is indeed whole and complete. Thus, they are all situated in the Lord."],t.w)
B.MO=new A.d(B.c,["\u0928 \u092a\u094d\u0930\u0939\u0943\u0937\u094d\u092f\u0947\u0924\u094d \u092a\u094d\u0930\u093f\u092f\u092e\u094d \u092a\u094d\u0930\u093e\u092a\u094d\u092f \u0928 \u0909\u0926\u094d\u0935\u093f\u091c\u0947\u0924\u094d \u092a\u094d\u0930\u093e\u092a\u094d\u092f \u091a\u093e\u092a\u094d\u0930\u093f\u0905\u092e\u094d \u0964\n\u0938\u094d\u0925\u093f\u0930 \u092c\u0941\u0926\u094d\u0927\u093f\u0930\u094d \u0905\u0938\u092e\u094d\u092e\u0942\u0922\u094b \u092c\u094d\u0930\u0939\u094d\u092e\u0935\u093f\u0926\u094d \u092c\u094d\u0930\u0939\u094d\u092e\u0923\u093f \u0938\u094d\u0925\u093f\u0924\u0903 \u0965\u0968\u0966 \u0965","He doesn\u2019t\u200b get excited on obtaining something he likes and doesn\u2019t\u200b get agitated on getting something he does not like. His intellect is firm and he does not get confused. He knows the nature of the Self and the Lord. He is situated in the quest for the Self."],t.w)
B.UK=new A.d(B.c,["\u092c\u093e\u0939\u094d\u092f \u0938\u094d\u092a\u0930\u094d\u0936\u0947\u0937\u0941 \u0905\u0938\u0915\u094d\u0924\u093e\u0924\u094d\u092e\u093e \u0935\u093f\u0928\u094d\u0926\u0924\u094d\u092f\u093e\u0924\u094d\u092e\u0928\u093f \u092f\u0903 \u0938\u0941\u0916\u092e\u094d \u0964\n\u0938 \u092c\u094d\u0930\u0939\u094d\u092e\u092f\u094b\u0917 \u092f\u0941\u0915\u094d\u0924\u093e\u0924\u094d\u092e\u093e \u0938\u0941\u0916\u092e\u094d \u0905\u0915\u094d\u0937\u092f\u092e\u094d \u0905\u0936\u094d\u0928\u0941\u0924\u0947 \u0965 \u0968\u0967 \u0965","The one who derives fulfillment in the Self, while remaining disinterested in external stimuli - he will have focus in the quest for the Self and the Lord and will enjoy un-ending joy."],t.w)
B.Tu=new A.d(B.c,["\u092f\u0947 \u0939\u093f \u0938\u092e\u094d\u0938\u094d\u092a\u0930\u094d\u0936\u091c\u093e \u092d\u094b\u0917\u093e \u0926\u0941\u0903\u0916\u092f\u094b\u0928\u092f \u090f\u0935 \u0924\u0947 \u0964\n\u0906\u0926\u094d\u092f\u0928\u094d\u0924\u0935\u0928\u094d\u0924\u0903 \u0915\u094c\u0928\u094d\u0924\u0947\u092f \u0928 \u0924\u0947\u0937\u0941 \u0930\u092e\u0924\u0947 \u092c\u0941\u0927\u0903 \u0965 \u0968\u0968 \u0965","Arjuna, those enjoyments that are born out of stimuli supplied to the sense organs will inevitably lead to difficulties. They have a beginning and an end. The person who knows their true nature will not indulge in them."],t.w)
B.Mj=new A.d(B.c,["\u0936\u0915\u094d\u0928\u094b\u0924\u093f \u0907\u0939\u0948\u0935 \u092f\u0903 \u0938\u094b\u0922\u0941\u092e\u094d \u092a\u094d\u0930\u093e\u0915\u094d \u0936\u0930\u0940\u0930 \u0935\u093f\u092e\u094b\u0915\u094d\u0937\u0923\u093e\u0924\u094d \u0964\n\u0915\u093e\u092e \u0915\u094d\u0930\u094b\u0927\u094b\u0926\u094d\u092d\u0935\u092e\u094d \u0935\u0947\u0917\u092e\u094d \u0938 \u092f\u0941\u0915\u094d\u0924\u0903 \u0938 \u0938\u0941\u0916\u0940 \u0928\u0930\u0903 \u0965 \u0968\u0969 \u0965","Before separating from the body, the person who is able to overcome the rush born out of desire and anger, while still being in this material world is the focused one. He is a fulfilled person."],t.w)
B.Sf=new A.d(B.c,["\u092f\u094b \u0905\u0928\u094d\u0924\u0938\u094d\u0938\u0941\u0916\u094b \u0905\u0928\u094d\u0924\u0930\u093e\u0930\u093e\u092e\u0903 \u0924\u0925\u093e \u0905\u0928\u094d\u0924\u0930\u094d\u091c\u094d\u092f\u094b\u0924\u093f\u0930\u0947\u0935 \u092f\u0903 \u0964\n\u0938 \u092f\u094b\u0917\u0940 \u092c\u094d\u0930\u0939\u094d\u092e \u0928\u093f\u0930\u094d\u0935\u093e\u0923\u092e\u094d \u092c\u094d\u0930\u0939\u094d\u092e \u092d\u0942\u0924\u094b\u093d\u0927\u093f\u0917\u091a\u094d\u091b\u0924\u093f \u0965 \u0968\u096a \u0965","The person who is content with his Self, who delights in his Self, and the one who is illuminated from the inside works without attachment while being situated in his Self. He will attain the infinite joy present in the Self and the Lord."],t.w)
B.NY=new A.d(B.c,["\u0932\u092d\u0928\u094d\u0924\u0947 \u092c\u094d\u0930\u0939\u094d\u092e \u0928\u093f\u0930\u094d\u0935\u093e\u0923\u092e\u094d \u090b\u0937\u092f\u0903 \u0915\u094d\u0937\u0940\u0923 \u0915\u0932\u094d\u092e\u0937\u093e\u0903 \u0964\n\u091b\u093f\u0928\u094d\u0928 \u0926\u094d\u0935\u0948\u0927\u093e \u092f\u0924\u093e\u0924\u094d\u092e\u093e\u0928\u0903 \u0938\u0930\u094d\u0935 \u092d\u0942\u0924 \u0939\u093f\u0924\u0947 \u0930\u0924\u093e\u0903 \u0965 \u0968\u096b \u0965","Those who are committed to the realization of the Self are free of the dualities of this world. They have focused their mind exclusively on the Self. They delight in the affection among all beings, get rid of all faults that come in the way of realizing the Self and obtain the infinite joy present in the Lord."],t.w)
B.Nw=new A.d(B.c,["\u0915\u093e\u092e \u0915\u094d\u0930\u094b\u0927 \u0935\u093f\u092f\u0941\u0915\u094d\u0924\u093e\u0928\u093e\u092e\u094d \u092f\u0924\u0940\u0928\u093e\u092e\u094d \u092f\u0924\u091a\u0947\u0924\u0938\u093e\u092e\u094d \u0964\n\u0905\u092d\u093f\u0924\u094b \u092c\u094d\u0930\u0939\u094d\u092e \u0928\u093f\u0930\u094d\u0935\u093e\u0923\u092e\u094d \u0935\u0930\u094d\u0924\u0924\u0947 \u0935\u093f\u091c\u093f\u0924\u093e\u0924\u094d\u092e\u0928\u093e\u092e\u094d \u0965 \u0968\u096c \u0965","The joy of experiencing the Self and the Lord stays with people who disengage from desire and anger, who strive to realize the Self, who have gained control over their consciousness and who have conquered their mind."],t.w)
B.PP=new A.d(B.c,["\u0938\u094d\u092a\u0930\u094d\u0936\u093e\u0928\u094d \u0915\u0943\u0924\u094d\u0935\u093e \u092c\u0939\u093f\u0930\u094d\u092c\u093e\u0939\u094d\u092f\u093e\u0928\u094d \u091a\u0915\u094d\u0937\u0941\u0936\u094d\u091a\u0948\u0935 \u0905\u0928\u094d\u0924\u0930\u0947 \u092d\u094d\u0930\u0941\u0935\u094b\u0903 \u0964\n\u092a\u094d\u0930\u093e\u0923\u093e\u092a\u093e\u0928\u094c \u0938\u092e\u094c \u0915\u0943\u0924\u094d\u0935\u093e \u0928\u093e\u0938\u093e\u092d\u094d\u092f\u0928\u094d\u0924\u0930 \u091a\u093e\u0930\u093f\u0923\u094c \u0965 \u0968\u096d \u0965\n\u092f\u0924\u0947\u0928\u094d\u0926\u094d\u0930\u093f\u092f \u092e\u0928\u094b \u092c\u0941\u0926\u094d\u0927\u093f\u0903 \u092e\u0941\u0928\u093f\u0930\u094d\u092e\u094b\u0915\u094d\u0937 \u092a\u0930\u093e\u092f\u0923\u0903 \u0964\n\u0935\u093f\u0917\u0924\u0940\u091a\u094d\u091b\u093e \u092d\u092f \u0915\u094d\u0930\u094b\u0927\u094b \u092f\u0938\u094d\u0938\u0926\u093e \u092e\u0941\u0915\u094d\u0924 \u090f\u0935 \u0938\u0903 \u0965 \u0968\u096e \u0965","A person having the intention to realize the Self, who has moksha as his only goal, keeps external stimuli outside and the eyes focused in-between the eye-brows. Balancing inhalation and exhalation through the nose, he takes charge of his organs, mind and his intellect. He is beyond desire, fear and anger. Such a person stays liberated from this material world."],t.w)
B.M3=new A.d(B.c,["\u092d\u094b\u0915\u094d\u0924\u093e\u0930\u092e\u094d \u092f\u0917\u094d\u0928 \u0924\u092a\u0938\u093e\u092e\u094d \u0938\u0930\u094d\u0935 \u0932\u094b\u0915 \u092e\u0939\u0947\u0936\u094d\u0935\u0930\u092e\u094d \u0964\n\u0938\u0941\u0939\u0943\u0926\u092e\u094d \u0938\u0930\u094d\u0935 \u092d\u0942\u0924\u093e\u0928\u093e\u092e\u094d \u091c\u094d\u091e\u093e\u0924\u094d\u0935\u093e \u092e\u093e\u092e\u094d \u0936\u093e\u0928\u094d\u0924\u093f\u092e\u0943\u091a\u094d\u091b\u0924\u093f \u0965 \u0968\u096f \u0965","He will attain peace by knowing me, the enjoyer of worship and prayer, the Lord of all the worlds, a friend and ally of all beings."],t.w)
B.PC=new A.d(B.c,["\u0905\u0928\u093e\u0936\u094d\u0930\u093f\u0924\u0903 \u0915\u0930\u094d\u092e \u092b\u0932\u092e\u094d \u0915\u093e\u0930\u094d\u092f\u092e\u094d \u0915\u0930\u094d\u092e \u0915\u0930\u094b\u0924\u093f \u092f\u0903 \u0964\n\u0938 \u0938\u0902\u0928\u094d\u092f\u093e\u0938\u0940 \u091a \u092f\u094b\u0917\u0940 \u091a \u0928 \u0928\u093f\u0930\u093e\u0917\u094d\u0928\u093f\u0930\u094d\u0928 \u091a\u093e\u0915\u094d\u0930\u093f\u092f\u0903 \u0965 \u0967 \u0965","The person who does the work\u200b that's to be done without depending on the outcome to drive him is the one who has renounced outcomes. He works without being driven. He is not without fire, neither is he idle."],t.w)
B.Rx=new A.d(B.c,["\u092f\u092e\u094d \u0938\u0902\u0928\u094d\u092f\u093e\u0938 \u0907\u0924\u093f \u092a\u094d\u0930\u093e\u0939\u0941\u0903 \u092f\u094b\u0917\u092e\u094d \u0924\u092e\u094d \u0935\u093f\u0926\u094d\u0927\u093f \u092a\u093e\u0923\u094d\u0921\u0935 \u0964\n\u0928 \u0939\u093f \u0905\u0938\u0902\u0928\u094d\u092f\u0938\u094d\u0924 \u0938\u0919\u094d\u0915\u0932\u094d\u092a\u094b \u092f\u094b\u0917\u0940 \u092d\u0935\u0924\u093f \u0915\u0936\u094d\u091a\u0928 \u0965 \u0968 \u0965","Arjuna, know that what\u2019s called renunciation is activity that isn\u2019t driven by desire. Anyone who doesn\u2019t give up expectations cannot practice such activity."],t.w)
B.Oc=new A.d(B.c,["\u0906\u0930\u0941\u0930\u0941\u0915\u094d\u0937\u094b\u0903 \u092e\u0941\u0928\u0947\u0930\u094d\u092f\u094b\u0917\u092e\u094d \u0915\u0930\u094d\u092e \u0915\u093e\u0930\u0923\u092e\u094d \u0909\u091a\u094d\u092f\u0924\u0947 \u0964\n\u092f\u094b\u0917\u093e\u0930\u0942\u0922\u0938\u094d\u092f \u0924\u0938\u094d\u092f\u0948\u0935 \u0936\u092e\u0903 \u0915\u093e\u0930\u0923\u092e\u094d \u0909\u091a\u094d\u092f\u0924\u0947 \u0965 \u0969 \u0965","To the enthusiast who wants to ascend to realization, activity is said to be the means. To a person who is well-established in the realization of his Self, tranquility and meditation are said to be the principle of existence."],t.w)
B.Sb=new A.d(B.c,["\u092f\u0926\u093e \u0939\u093f \u0928\u0947\u0928\u094d\u0926\u094d\u0930\u093f\u092f\u093e\u0930\u094d\u0925\u0947\u0937\u0941 \u0928 \u0915\u0930\u094d\u092e\u0938\u0941 \u0905\u0928\u0941\u0937\u091c\u094d\u091c\u0924\u0947 \u0964\n\u0938\u0930\u094d\u0935 \u0938\u0919\u094d\u0915\u0932\u094d\u092a \u0938\u0902\u0928\u094d\u092f\u093e\u0938\u0940 \u092f\u094b\u0917\u093e\u0930\u0942\u0922\u0903 \u0924\u0926\u094b\u091a\u094d\u092f\u0924\u0947 \u0965 \u096a \u0965","When a person is not attached to sensual things, nor to the activities associated with those stimuli, then, he is free from attachments towards desires. He is said to be firmly situated in the realization of the Self."],t.w)
B.Rm=new A.d(B.c,["\u0909\u0926\u094d\u0927\u0930\u0947\u0924\u094d \u0906\u0924\u094d\u092e\u0928\u093e\u093d\u0924\u094d\u092e\u093e\u0928\u092e\u094d \u0928 \u0906\u0924\u094d\u092e\u093e\u0928\u092e\u094d \u0905\u0935\u0938\u093e\u0926\u092f\u0947\u0924\u094d \u0964\n\u0906\u0924\u094d\u092e\u0948\u0935 \u0939\u093f \u0906\u0924\u094d\u092e\u0928\u094b \u092c\u0928\u094d\u0927\u0941\u0903 \u0906\u0924\u094d\u092e\u0948\u0935 \u0930\u093f\u092a\u0941\u0930\u093e\u0924\u094d\u092e\u0928\u0903 \u0965 \u096b \u0965","With his own intent, detached from material desires, he needs to achieve progress in his own self. He must not get disheartened and give up in defeat. His own intention is his friend. His intentions can be his enemies."],t.w)
B.V7=new A.d(B.c,["\u092c\u0928\u094d\u0927\u0941\u0930\u093e\u0924\u094d\u092e\u093e\u093d\u0924\u094d\u092e\u0928\u0938\u094d\u0924\u0938\u094d\u092f \u092f\u0947\u0928 \u0906\u0924\u094d\u092e\u0948\u0935 \u0906\u0924\u094d\u092e\u0928\u093e \u091c\u093f\u0924\u0903 \u0964\n\u0905\u0928\u093e\u0924\u094d\u092e\u0928\u0938\u094d\u0924\u0941 \u0936\u0924\u094d\u0930\u0941\u0924\u094d\u0935\u0947 \u0935\u0930\u094d\u0924\u0947\u0924\u094d \u0906\u0924\u094d\u092e\u0948\u0935 \u0936\u0924\u094d\u0930\u0941\u0935\u0924\u094d \u0965 \u096c \u0965","The intentions of a being are favorable when his own mind and intentions have been won over by the Self in him. However, to a person who has not won over his mind, his very intentions stand as his foe and remain to work against him."],t.w)
B.OV=new A.d(B.c,["\u091c\u093f\u0924\u093e\u0924\u094d\u092e\u0928\u0903 \u092a\u094d\u0930\u0936\u093e\u0928\u094d\u0924\u0938\u094d\u092f \u092a\u0930\u092e\u093e\u0924\u094d\u092e\u093e \u0938\u092e\u093e\u0939\u093f\u0924\u0903 \u0964\n\u0936\u0940\u0924\u094b\u0936\u094d\u0923 \u0938\u0941\u0916 \u0926\u0941\u0903\u0916\u0947\u0937\u0941 \u0924\u0925\u093e \u092e\u093e\u0928 \u0905\u092a\u092e\u093e\u0928\u092f\u094b\u0903 \u0965 \u096d \u0965","Having conquered his mind, a person who is at peace is completely focused on the Self, which has the Lord as the basis for its existence in situations of cold, heat, comfort, difficulties, during fame and insult too."],t.w)
B.Tb=new A.d(B.c,["\u091c\u094d\u091e\u093e\u0928 \u0935\u093f\u091c\u094d\u091e\u093e\u0928 \u0924\u0943\u092a\u094d\u0924\u093e\u0924\u094d\u092e\u093e \u0915\u0942\u091f\u0938\u094d\u0925\u094b \u0935\u093f\u091c\u093f\u0924\u0947\u0928\u094d\u0926\u094d\u0930\u093f\u092f\u0903 \u0964\n\u092f\u0941\u0915\u094d\u0924 \u0907\u0924\u094d\u092f\u0941\u091a\u094d\u092f\u0924\u0947 \u092f\u094b\u0917\u0940 \u0938\u092e \u0932\u094b\u0937\u094d\u0920\u093e\u0936\u094d\u092e \u0915\u093e\u0928\u094d\u091a\u0928\u0903 \u0965 \u096e \u0965","A person whose mind is content in the knowledge of the Self and the awareness to distinguish it from the environment has conquered his organs, knowing that he is the unchanging Self. This person works without being driven by desire. He views a lump of clay, a stone and gold with equanimity. He is said to be focused and engaged."],t.w)
B.OX=new A.d(B.c,["\u0938\u0941\u0939\u0943\u0928\u094d \u092e\u093f\u0924\u094d\u0930\u093e\u0930\u093f \u0909\u0926\u093e\u0938\u0940\u0928 \u092e\u0927\u094d\u092f\u0938\u094d\u0925 \u0926\u094d\u0935\u0947\u0937\u094d\u092f \u092c\u0928\u094d\u0927\u0941\u0937\u0941 \u0964\n\u0938\u093e\u0927\u0941\u0937\u094d\u0935\u092a\u093f \u091a \u092a\u093e\u092a\u0947\u0937\u0941 \u0938\u092e \u092c\u0941\u0926\u094d\u0927\u093f\u0930\u094d \u0935\u093f\u0936\u093f\u0937\u094d\u092f\u0924\u0947 \u0965 \u096f \u0965","A person is distinguished and superior when he is level-headed among friends, foes, the affectionate, companions of the same age, enemies, disinterested people, neutrals, even among the good people and the offenders."],t.w)
B.TG=new A.d(B.c,["\u092f\u094b\u0917\u0940 \u092f\u0941\u0928\u094d\u091c\u0940\u0924 \u0938\u0924\u0924\u092e\u094d \u0906\u0924\u094d\u092e\u093e\u0928\u092e\u094d \u0930\u0939\u0938\u093f \u0938\u094d\u0925\u093f\u0924\u0903 \u0964\n\u090f\u0915\u093e\u0915\u0940 \u092f\u0924\u091a\u093f\u0924\u094d\u0924\u093e\u0924\u094d\u092e\u093e \u0928\u093f\u0930\u093e\u0936\u0940\u0930\u092a\u0930\u093f\u0917\u094d\u0930\u0939\u0903 \u0965 \u0967\u0966 \u0965","Such a person, who works without being driven by desire must meditate on the true nature of the Self daily in a place that is not public, being by himself, keeping his mind and intellect under control, not being interested in anything else and not giving into possessiveness."],t.w)
B.Ni=new A.d(B.c,["\u0936\u0941\u091a\u094c \u0926\u0947\u0936\u0947 \u092a\u094d\u0930\u0924\u093f\u0937\u094d\u0920\u093e\u092a\u094d\u092f \u0938\u094d\u0925\u093f\u0930\u092e\u094d \u0906\u0938\u0928\u092e\u094d \u0906\u0924\u094d\u092e\u0928\u0903 \u0964\n\u0928\u093e\u0924\u094d\u092f\u0941\u091a\u094d\u091b\u094d\u0930\u093f\u0924\u092e\u094d \u0928\u093e\u0924\u093f \u0928\u0940\u091a\u092e\u094d \u091a\u0947\u0932\u093e\u091c\u093f\u0928 \u0915\u0941\u0936\u094b\u0924\u094d\u0924\u0930\u092e\u094d \u0965 \u0967\u0967 \u0965\n\u0924\u0924\u094d\u0930\u0948\u0915\u093e\u0917\u094d\u0930\u094d\u092f\u092e\u094d \u092e\u0928\u0903 \u0915\u0943\u0924\u094d\u0935\u093e \u092f\u0924 \u091a\u093f\u0924\u094d\u0924\u0947\u0928\u094d\u0926\u094d\u0930\u093f\u0905 \u0915\u094d\u0930\u093f\u092f\u0903 \u0964\n\u0909\u092a\u0935\u093f\u0936\u094d\u092f\u093e\u0938\u0928\u0947 \u092f\u0941\u0928\u094d\u091c\u094d\u092f\u093e\u0924\u094d \u092f\u094b\u0917\u092e\u094d \u0906\u0924\u094d\u092e \u0935\u093f\u0936\u0941\u0926\u094d\u0927\u092f\u0947 \u0965 \u0967\u0968 \u0965","Setting up a stable seat for himself in a place that is clean, not too high, not too low, keeping cloth, fur and straw on it, sitting there, keeping his mind focused controlling the works of the organs and the intellect, he employs his body to work without being driven by desire to purify his Self."],t.w)
B.PS=new A.d(B.c,["\u0938\u092e\u092e\u094d \u0915\u093e\u092f \u0936\u093f\u0930\u094b\u0917\u094d\u0930\u0940\u0935\u092e\u094d \u0927\u093e\u0930\u092f\u0928\u094d \u0905\u091a\u0932\u092e\u094d \u0938\u094d\u0925\u093f\u0930\u092e\u094d \u0964\n\u0938\u092e\u094d\u092a\u094d\u0930\u0947\u0915\u094d\u0937\u094d\u092f \u0928\u093e\u0938\u093f\u0915\u093e\u0917\u094d\u0930\u092e\u094d \u0938\u094d\u0935\u092e\u094d \u0926\u093f\u0936\u0936\u094d\u091a \u0905\u0928\u0935\u0932\u094b\u0915\u092f\u0928\u094d \u0965 \u0967\u0969 \u0965\n\u092a\u094d\u0930\u0936\u093e\u0928\u094d\u0924\u093e\u0924\u094d\u092e\u093e \u0935\u093f\u0917\u0924 \u092d\u0940\u0903 \u092c\u094d\u0930\u0939\u094d\u092e\u091a\u093e\u0930\u093f \u0935\u094d\u0930\u0924\u0947 \u0938\u094d\u0925\u093f\u0924\u0903 \u0964\n\u092e\u0928\u0938\u094d\u0938\u092e\u094d\u092f\u092e\u094d\u092f \u092e\u091a\u094d\u091a\u093f\u0924\u094d\u0924\u094b \u092f\u0941\u0915\u094d\u0924 \u0906\u0938\u0940\u0924 \u092e\u0924\u094d\u092a\u0930\u0903 \u0965 \u0967\u096a \u0965","Keeping the body, the head and the neck in line, stable, without changing position, looking at the uppermost part of his nose, without looking in different directions, with a peaceful mind, without being afraid of anything, situated in the vow of celibacy, keeping his mind under control, with the consciousness dedicated to Me, a person must remain focused on the Self, knowing that I pervade everything ultimately."],t.w)
B.Tg=new A.d(B.c,["\u092f\u0941\u0928\u094d\u091c\u0928\u094d\u0928\u0947\u0935\u092e\u094d \u0938\u0926\u093e \u0906\u0924\u094d\u092e\u093e\u0928\u092e\u094d \u092f\u094b\u0917\u0940 \u0928\u093f\u092f\u0924 \u092e\u093e\u0928\u0938\u0903 \u0964\n\u0936\u093e\u0928\u094d\u0924\u093f\u092e\u094d \u0928\u093f\u0930\u094d\u0935\u093e\u0923 \u092a\u0930\u092e\u093e\u092e\u094d \u092e\u0924\u094d\u0938\u092e\u094d\u0938\u094d\u0925\u093e\u092e\u094d \u0905\u0927\u093f\u0917\u091a\u094d\u091b\u0924\u093f \u0965 \u0967\u096b \u0965","The person who offers his work as worship to Me will fix his mind in this way always. Controlling his mind to focus on Me, he reaches the ultimate joy and peace that resides in Me."],t.w)
B.NU=new A.d(B.c,["\u0928\u093e\u0924\u094d\u092f\u0936\u094d\u0928\u0924\u0938\u094d\u0924\u0941 \u092f\u094b\u0917\u094b\u093d\u0938\u094d\u0924\u093f \u0928 \u091a\u0948\u0915\u093e\u0928\u094d\u0924\u092e\u094d \u0905\u0928\u0936\u094d\u0928\u0924\u0903 \u0964\n\u0928 \u091a\u093e\u0924\u093f \u0938\u094d\u0935\u092a\u094d\u0928 \u0936\u0940\u0932\u0938\u094d\u092f \u091c\u093e\u0917\u094d\u0930\u0924\u094b \u0928\u0948\u0935 \u091a \u0905\u0930\u094d\u091c\u0941\u0928 \u0965 \u0967\u096c \u0965\n\u092f\u0941\u0915\u094d\u0924 \u0906\u0939\u093e\u0930 \u0935\u093f\u0939\u093e\u0930\u0938\u094d\u092f \u092f\u0941\u0915\u094d\u0924 \u091a\u0947\u0937\u094d\u091f\u0938\u094d\u092f \u0915\u0930\u094d\u092e\u0938\u0941 \u0964\n\u092f\u0941\u0915\u094d\u0924 \u0938\u094d\u0935\u092a\u094d\u0928\u093e\u0935\u092c\u094b\u0927\u0938\u094d\u092f \u092f\u094b\u0917\u094b \u092d\u0935\u0924\u093f \u0926\u0941\u0903\u0916 \u0939\u093e \u0965 \u0967\u096d \u0965","Arjuna, the quest for the realization of the Self is not for one who eats excessively. A person who does not eat will not have a singularity of purpose either. It is not for a person who sleeps excessively either. Neither is it for a person who is awake all the time. This quest will be the destroyer of sorrow for one who eats and enjoys appropriately, and exerts himself appropriately in his work."],t.w)
B.O0=new A.d(B.c,["\u092f\u0926\u093e \u0935\u093f\u0928\u093f\u092f\u0924\u092e\u094d \u091a\u093f\u0924\u094d\u0924\u092e\u094d \u0906\u0924\u094d\u092e\u0928\u094d\u092f\u0947\u0935 \u0905\u0935\u0924\u093f\u0937\u094d\u0920\u0924\u0947 \u0964\n\u0928\u093f\u0903\u0938\u094d\u092a\u0943\u0939\u0903 \u0938\u0930\u094d\u0935 \u0915\u093e\u092e\u0947\u092d\u094d\u092f\u094b \u092f\u0941\u0915\u094d\u0924 \u0907\u0924\u094d\u092f\u0941\u091a\u094d\u092f\u0924\u0947 \u0924\u0926\u093e \u0965 \u0967\u096e \u0965","When a person\u2019s consciousness stays firm in the Self alone, without attachments towards any desires, then the person is said to be focused and deserves to realize the Self."],t.w)
B.Qc=new A.d(B.c,["\u092f\u0925\u093e \u0926\u0940\u092a\u094b \u0928\u093f\u0935\u093e\u0924\u0938\u094d\u0925\u094b \u0928\u0947\u0919\u094d\u0917\u0924\u0947 \u0938\u094b\u092a\u092e\u093e \u0938\u094d\u092e\u0943\u0924\u093e \u0964\n\u092f\u094b\u0917\u093f\u0928\u094b \u092f\u0924\u091a\u093f\u0924\u094d\u0924\u0938\u094d\u092f \u092f\u0941\u0928\u094d\u091c\u0924\u094b \u092f\u094b\u0917\u092e\u093e\u0924\u094d\u092e\u0928\u0903 \u0965 \u0967\u096f \u0965","The Self in a person who works purely as worship to the Lord , who controls his consciousness, who is dedicated and focused in his quest to realize the Self is considered similar to a flame that stays without shaking in a place without winds."],t.w)
B.P6=new A.d(B.c,["\u092f\u0924\u094d\u0930 \u0909\u092a\u0930\u092e\u0924\u0947 \u091a\u093f\u0924\u094d\u0924\u092e\u094d \u0928\u093f\u0930\u0941\u0926\u094d\u0927\u092e\u094d \u092f\u094b\u0917 \u0938\u0947\u0935\u092f\u093e \u0964\n\u092f\u0924\u094d\u0930 \u091a\u0948\u0935\u093e\u0924\u094d\u092e\u0928\u093e \u0906\u0924\u094d\u092e\u093e\u0928\u092e\u094d \u092a\u0936\u094d\u092f\u0928\u094d \u0906\u0924\u094d\u092e\u0928\u093f \u0924\u0941\u0937\u094d\u092f\u0924\u093f \u0965 \u0968\u0966 \u0965\n\u0938\u0941\u0916\u092e\u094d \u0905\u0924\u094d\u092f\u0928\u094d\u0924\u093f\u0915\u092e\u094d \u092f\u0924\u094d\u0924\u0926\u094d \u092c\u0941\u0926\u094d\u0927\u093f\u0917\u094d\u0930\u093e\u0939\u094d\u092f\u092e\u094d \u0905\u0924\u0940\u0928\u094d\u0926\u094d\u0930\u093f\u092f\u092e\u094d \u0964\n\u0935\u0947\u0924\u094d\u0924\u093f \u092f\u0924\u094d\u0930 \u0928 \u091a\u0948\u0935\u093e\u092f\u092e\u094d \u0938\u094d\u0925\u093f\u0924\u0903 \u091a\u0932\u0924\u093f \u0924\u0924\u094d\u0924\u094d\u0935\u0924\u0903 \u0965 \u0968\u0967 \u0965\n\u092f\u092e\u094d \u0932\u092c\u094d\u0927\u094d\u0935\u093e \u091a\u093e\u092a\u0930\u092e\u094d \u0932\u093e\u092d\u092e\u094d \u092e\u0928\u094d\u092f\u0924\u0947 \u0928\u093e\u0927\u093f\u0915\u092e\u094d \u0924\u0924\u0903 \u0964\n\u092f\u0938\u094d\u092e\u093f\u0928\u094d \u0938\u094d\u0925\u093f\u0924\u0903 \u0928 \u0926\u0941\u0903\u0916\u0947\u0928 \u0917\u0941\u0930\u0941\u0923\u093e\u093d\u092a\u093f \u0935\u093f\u091a\u093e\u0932\u094d\u092f\u0924\u0947 \u0965 \u0968\u0968 \u0965\n\u0924\u092e\u094d \u0935\u093f\u0926\u094d\u092f\u093e\u0924\u094d \u0926\u0941\u0903\u0916\u0938\u092e\u094d\u092f\u094b\u0917 \u0935\u093f\u092f\u094b\u0917\u092e\u094d \u092f\u094b\u0917 \u0938\u0928\u094d\u091c\u094d\u091e\u093f\u0924\u092e\u094d \u0964\n\u0938 \u0928\u093f\u0936\u094d\u091a\u092f\u0947\u0928 \u092f\u094b\u0915\u094d\u0924\u0935\u094d\u092f\u094b \u092f\u094b\u0917\u094b\u093d\u0928\u093f\u0930\u094d\u0935\u093f\u0923\u094d\u0923 \u091a\u0947\u0924\u0938\u093e \u0965 \u0968\u0969 \u0965","The state of being, in which the consciousness, controlled and focused for the purpose of realizing the Self and the Lord experiences ultimate joy, in which the consciousness sees the Self by using the mind and is content in the knowledge of the Self alone, in which it knows the unparalleled joy, which can only be grasped by knowledge , being beyond the reach of the senses - indeed, when it is situated in that state, it does not move from this ultimate reality. Further, having attained that state, it does not consider other benefits to be more valuable. While being in this state it does not get toppled even by huge difficulties and sorrows. Know that this state of being, which detaches you from bondage and sorrow is called \u2018yoga\u2019. This yoga is to be practiced with enthusiasm, without doubt."],t.w)
B.M7=new A.d(B.c,["\u0938\u0919\u094d\u0915\u0932\u094d\u092a \u092a\u094d\u0930\u092d\u0935\u093e\u0928\u094d \u0915\u093e\u092e\u093e\u0928\u094d \u0924\u094d\u092f\u0915\u094d\u0924\u094d\u0935\u093e \u0938\u0930\u094d\u0935\u093e\u0928\u094d \u0905\u0936\u0947\u0937\u0924\u0903 \u0964\n\u092e\u0928\u0938\u094d\u092f\u0948\u0935 \u0907\u0928\u094d\u0926\u094d\u0930\u093f\u092f \u0917\u094d\u0930\u093e\u092e\u092e\u094d \u0935\u093f\u0928\u093f\u092f\u092e\u094d\u092f \u0938\u092e\u0928\u094d\u0924\u0924\u0903 \u0965 \u0968\u096a \u0965\n\u0936\u0928\u0948\u0903 \u0936\u0928\u0948\u0930\u0941\u092a\u0930\u092e\u0947\u0924\u094d \u092c\u0941\u0926\u094d\u0927\u094d\u092f\u093e \u0927\u0943\u0924\u093f \u0917\u0943\u0939\u0940\u0924\u092f\u093e \u0964\n\u0906\u0924\u094d\u092e\u0938\u092e\u094d\u0938\u094d\u0925\u092e\u094d \u092e\u0928\u0903 \u0915\u0943\u0924\u094d\u0935\u093e \u0928 \u0915\u093f\u0928\u094d\u091a\u093f\u0926\u092a\u093f \u091a\u093f\u0928\u094d\u0924\u092f\u0947\u0924\u094d \u0965 \u0968\u096b \u0965","Giving up all desires that arise out of our intentions without exceptions, controlling the group of organs in all ways using the mind itself, stationing the mind in the Self giving up, little by little, things other than the Self, using the knowledge grasped by perseverance, do not be anxious about anything."],t.w)
B.TR=new A.d(B.c,["\u092f\u0924\u094b \u092f\u0924\u094b \u0928\u093f\u0936\u094d\u091a\u0930\u0924\u093f \u092e\u0928\u0903 \u091a\u0928\u094d\u091a\u0932\u092e\u094d \u0905\u0938\u094d\u0925\u093f\u0930\u092e\u094d \u0964\n\u0924\u0924\u0938\u094d\u0924\u0924\u094b \u0928\u093f\u092f\u092e\u094d\u092f\u0948\u0924\u0924\u094d \u0906\u0924\u094d\u092e\u0928\u094d\u092f\u0947\u0935 \u0935\u0936\u092e\u094d \u0928\u092f\u0947\u0924\u094d \u0965 \u0968\u096c \u0965","The ever-wandering unstable mind needs to be brought under control among things that make it wander. Constrain it in the Self alone."],t.w)
B.PK=new A.d(B.c,["\u092a\u094d\u0930\u0936\u093e\u0928\u094d\u0924 \u092e\u0928\u0938\u092e\u094d \u0939\u094d\u092f\u0947\u0928\u092e\u094d \u092f\u094b\u0917\u093f\u0928\u092e\u094d \u0938\u0941\u0916\u092e\u094d \u0909\u0924\u094d\u0924\u092e\u092e\u094d \u0964\n\u0909\u092a\u0948\u0924\u093f \u0936\u093e\u0928\u094d\u0924\u0930\u091c\u0938\u092e\u094d \u092c\u094d\u0930\u0939\u094d\u092e\u092d\u0942\u0924\u092e\u094d \u0905\u0915\u0932\u094d\u092e\u0937\u092e\u094d \u0965 \u0968\u096d \u0965","Ultimate joy will definitely come to this person, who is in the quest for the Self , whose mind is at peace, whose passions have subsided , who is situated in the true nature of the Self, who is rid of all his faults."],t.w)
B.NA=new A.d(B.c,["\u090f\u0935\u092e\u094d \u092f\u0941\u0928\u094d\u091c\u0928\u094d \u0938\u0926\u093e\u0924\u094d\u092e\u093e\u0928\u092e\u094d \u092f\u094b\u0917\u0940 \u0935\u093f\u0917\u0924 \u0915\u0932\u094d\u092e\u0937\u0903 \u0964\n\u0938\u0941\u0916\u0947\u0928 \u092c\u094d\u0930\u0939\u094d\u092e \u0938\u092e\u094d\u0938\u094d\u092a\u0930\u094d\u0936\u092e\u094d \u0905\u0924\u094d\u092f\u0928\u094d\u0924\u092e\u094d \u0938\u0941\u0916\u092e\u094d \u0905\u0936\u094d\u0928\u0941\u0924\u0947 \u0965 \u0968\u096e \u0965","In this way, a person who works without being driven stays in the quest for the Self. He easily experiences the ultimate joy of being in touch with the Self always, flawlessly."],t.w)
B.OA=new A.d(B.c,["\u0938\u0930\u094d\u0935 \u092d\u0942\u0924\u0938\u094d\u0925\u092e\u094d \u0906\u0924\u094d\u092e\u093e\u0928\u092e\u094d \u0938\u0930\u094d\u0935 \u092d\u0942\u0924\u093e\u0928\u093f \u091a\u093e\u0924\u094d\u092e\u0928\u093f \u0964\n\u0908\u0915\u094d\u0937\u0924\u0947 \u092f\u094b\u0917\u092f\u0941\u0915\u094d\u0924\u093e\u0924\u094d\u092e\u093e \u0938\u0930\u094d\u0935\u0924\u094d\u0930 \u0938\u092e\u0926\u0930\u094d\u0936\u0928\u0903 \u0965 \u0968\u096f \u0965","A person who is firm in his quest for the Self sees himself as being present within every being, and all the beings in his Self. He has an equal outlook everywhere."],t.w)
B.Ru=new A.d(B.c,["\u092f\u094b \u092e\u093e\u092e\u094d \u092a\u0936\u094d\u092f\u0924\u093f \u0938\u0930\u094d\u0935\u0924\u094d\u0930 \u0938\u0930\u094d\u0935\u092e\u094d \u091a \u092e\u092f\u093f \u092a\u0936\u094d\u092f\u0924\u093f \u0964\n\u0924\u0938\u094d\u092f\u093e\u0939\u092e\u094d \u0928 \u092a\u094d\u0930\u0923\u0936\u094d\u092f\u093e\u092e\u093f \u0938 \u091a \u092e\u0947 \u0928 \u092a\u094d\u0930\u0923\u0936\u094d\u092f\u0924\u093f \u0965 \u0969\u0966 \u0965","For the one who sees me everywhere and sees everything in me, I will not go unseen. He does not go unseen to me either."],t.w)
B.MA=new A.d(B.c,["\u0938\u0930\u094d\u0935\u092d\u0942\u0924\u0938\u094d\u0925\u092e\u094d \u092f\u094b \u092e\u093e\u092e\u094d \u092d\u091c\u0924\u093f \u090f\u0915\u0924\u094d\u0935\u092e\u093e\u0938\u094d\u0925\u093f\u0924\u0903 \u0964\n\u0938\u0930\u094d\u0935\u0925\u093e \u0935\u0930\u094d\u0924\u092e\u093e\u0928\u094b\u093d\u092a\u093f \u0938 \u092f\u094b\u0917\u0940 \u092e\u092f\u093f \u0935\u0930\u094d\u0924\u0924\u0947 \u0965 \u0969\u0967 \u0965","The person who worships Me, the one who is situated in all beings, believes in My uniqueness and exists in one-ness with Me. This person, who is in the quest for the Self resides in Me, even though he exists in all kinds of situations."],t.w)
B.Tk=new A.d(B.c,["\u0906\u0924\u094d\u092e\u094c\u092a\u092e\u094d\u092f\u0947\u0928 \u0938\u0930\u094d\u0935\u0935\u094d\u0924\u094d\u0930 \u0938\u092e\u092e\u094d \u092a\u0936\u094d\u092f\u0924\u093f \u092f\u094b\u093d\u0905\u0930\u094d\u091c\u0941\u0928 \u0964\n\u0938\u0941\u0916\u092e\u094d \u0935\u093e \u092f\u0926\u093f \u0935\u093e \u0926\u0941\u0903\u0916\u092e\u094d \u0938 \u092f\u094b\u0917\u0940 \u092a\u0930\u092e\u094b \u092e\u0924\u0903 \u0965 \u0969\u0968 \u0965","Arjuna, the person who sees equality everywhere, whether in happiness or in difficulties due to the equivalence of the Self in everyone, this person, who is in the quest for realizing the Self is the ultimate \u2013 that is my opinion."],t.w)
B.On=new A.d(B.c,["\u0905\u0930\u094d\u091c\u0941\u0928 \u0909\u0935\u093e\u091a -\n\u092f\u094b\u093d\u092f\u092e\u094d \u092f\u094b\u0917\u0938\u094d\u0924\u094d\u0935\u092f\u093e \u092a\u094d\u0930\u094b\u0915\u094d\u0924\u0903 \u0938\u093e\u092e\u094d\u092f\u0947\u0928 \u092e\u0927\u0941\u0938\u0942\u0927\u0928 \u0964\n\u090f\u0924\u0938\u094d\u092f\u093e\u0939\u092e\u094d \u0928 \u092a\u0936\u094d\u092f\u093e\u092e\u093f \u091a\u0928\u094d\u091a\u0932\u0924\u094d\u0935\u093e\u0924\u094d \u0938\u094d\u0925\u093f\u0924\u093f\u092e\u094d \u0938\u094d\u0925\u093f\u0930\u093e\u092e\u094d \u0965 \u0969\u0969 \u0965\n\u091a\u0928\u094d\u091a\u0932\u092e\u094d \u0939\u093f \u092e\u0928\u0903 \u0915\u0943\u0936\u094d\u0923 \u092a\u094d\u0930\u092e\u093e\u0925\u093f \u092c\u0932\u0935\u0924\u094d \u0927\u0943\u0922\u092e\u094d \u0964\n\u0924\u0938\u094d\u092f\u093e\u0939\u092e\u094d \u0928\u093f\u0917\u094d\u0930\u0939\u092e\u094d \u092e\u0928\u094d\u092f\u0947 \u0935\u093e\u092f\u094b\u0930\u093f\u0935 \u0938\u0941\u0926\u0941\u0937\u094d\u0915\u0930\u092e\u094d \u0965 \u0969\u096a \u0965","Arjuna said Krishna, due to the mind being volatile, I do not see this yoga, which was told by you as equanimity, as a state with any stability. Krishna, the mind is indeed unstable. As if by force, it causes diversions that are very strong. I am of the opinion that it is extremely difficult to gain control over it, just as it is difficult to gain control over the wind."],t.w)
B.R5=new A.d(B.c,["\u0936\u094d\u0930\u0940 \u092d\u0917\u0935\u093e\u0928\u094d \u0909\u0935\u093e\u091a -\n\u0905\u0938\u092e\u094d\u0936\u092f\u092e\u094d \u092e\u0939\u093e\u092c\u093e\u0939\u094b \u092e\u0928\u094b \u0926\u0941\u0930\u094d\u0928\u093f\u0917\u094d\u0930\u0939\u092e\u094d \u091a\u0932\u092e\u094d \u0964\n\u0905\u092d\u094d\u092f\u093e\u0938\u0947\u0928 \u0924\u0941 \u0915\u094c\u0928\u094d\u0924\u0947\u092f \u0935\u0948\u0930\u093e\u0917\u094d\u092f\u0947\u0923 \u091a \u0917\u0943\u0939\u094d\u092f\u0924\u0947 \u0965 \u0969\u096b \u0965\n\u0905\u0938\u092e\u094d\u092f\u0924\u093e\u0924\u094d\u092e\u0928\u093e \u092f\u094b\u0917\u094b \u0926\u0941\u0937\u094d\u091f\u094d\u0930\u093e\u092a \u0907\u0924\u093f \u092e\u0947 \u092e\u0924\u093f\u0903 \u0964\n\u0935\u0936\u094d\u092f\u093e\u0924\u094d\u092e\u0928\u093e \u0924\u0941 \u092f\u0924\u0924\u093e \u0936\u0915\u094d\u092f\u094b\u093d\u0935\u093e\u092a\u094d\u0924\u0941\u092e\u094d \u0909\u092a\u093e\u092f\u0924\u0903 \u0965 \u0969\u096c \u0965","Lord Krishna said: O one with powerful arms, there is no doubt that the mind keeps wandering and is difficult to control. However, Arjuna, by practice and by preventing oneself from being driven by desire, it can be brought under our grip. Someone who doesn\u2019t\u200b have his mind under control would find it impossible to pursue the Self - this is my opinion. On the other hand, it is achievable by a person who has control, who perseveres according to the described methods."],t.w)
B.NJ=new A.d(B.c,["\u0905\u0930\u094d\u091c\u0941\u0928 \u0909\u0935\u093e\u091a -\n\u0905\u092f\u0924\u093f\u0903 \u0936\u094d\u0930\u0926\u094d\u0927\u092f\u094b\u092a\u0947\u0924\u094b \u092f\u094b\u0917\u093e\u0924\u094d \u091a\u0932\u093f\u0924 \u092e\u093e\u0928\u0938\u0903 \u0964\n\u0905\u092a\u094d\u0930\u093e\u092a\u094d\u092f \u092f\u094b\u0917 \u0938\u092e\u094d\u0938\u093f\u0926\u094d\u0927\u093f\u092e\u094d \u0915\u093e\u092e\u094d \u0917\u0924\u093f\u092e\u094d \u0915\u0943\u0937\u094d\u0923 \u0917\u091a\u094d\u091b\u0924\u093f \u0965 \u0969\u096d \u0965\n\u0915\u091a\u094d\u091a\u093f\u0924\u094d \u0909\u092d\u092f \u0935\u093f\u092d\u094d\u0930\u0937\u094d\u091f\u0903 \u091b\u093f\u0928\u094d\u0928\u093e\u092d\u094d\u0930\u092e\u093f\u0935 \u0928\u0936\u094d\u092f\u0924\u093f \u0964\n\u0905\u092a\u094d\u0930\u0924\u093f\u0937\u094d\u0920\u094b \u092e\u0939\u093e\u092c\u093e\u0939\u094b \u0935\u093f\u092e\u0942\u0922\u094b \u092c\u094d\u0930\u0939\u094d\u092e\u0923\u0903 \u092a\u0925\u093f \u0965 \u0969\u096e \u0965\n\u090f\u0924\u092e\u094d \u092e\u0947 \u0938\u092e\u094d\u0936\u092f\u092e\u094d \u0915\u0943\u0937\u094d\u0923! \u091b\u0947\u0924\u094d\u0924\u0941\u092e\u094d \u0905\u0930\u094d\u0939\u0938\u093f \u0905\u0936\u0947\u0937\u0924\u0903 \u0964\n\u0924\u094d\u0935\u0926\u0928\u094d\u092f\u0903 \u0938\u092e\u094d\u0937\u092f\u0938\u094d\u092f\u093e\u0938\u094d\u092f \u091b\u0947\u0924\u094d\u0924\u093e \u0928\u0939\u094d\u092f\u0941\u092a\u092a\u0926\u094d\u092f\u0924\u0947 \u0965 \u0969\u096f \u0965","Arjuna said: Krishna, a person with the best intentions and sufficient dedication without perseverance and proper efforts will have his mind wander from the path of realizing the Self. Without attaining the goal of realizing the Self, what will be his state? Will he not go wasted, being ineffective on both sides, like a small piece of cloud that gets separated from a big thunder-cloud? He would have nothing to rest on, having deviated from the path of realizing the Self and the Lord. O Krishna, this is my doubt! You have the ability to get rid of it completely. Other than You, there is indeed nobody who can get rid of this doubt."],t.w)
B.RD=new A.d(B.c,["\u0936\u094d\u0930\u0940 \u092d\u0917\u0935\u093e\u0928\u094d \u0909\u0935\u093e\u091a -\n\u092a\u093e\u0930\u094d\u0925 \u0928\u0948\u0935\u0947\u0939 \u0928\u093e\u092e\u0941\u0924\u094d\u0930 \u0935\u093f\u0928\u093e\u0936\u0938\u094d\u0924\u0938\u094d\u092f \u0935\u093f\u0926\u094d\u092f\u0924\u0947 \u0964\n\u0928 \u0939\u093f \u0915\u0932\u094d\u092f\u093e\u0923 \u0915\u0943\u0924\u094d \u0915\u0936\u094d\u091a\u093f\u0924\u094d \u0926\u0941\u0930\u094d\u0917\u0924\u093f\u092e\u094d \u0924\u093e\u0924 \u0917\u091a\u094d\u091b\u0924\u093f \u0965 \u096a\u0966 \u0965","Lord Krishna said \u2013 Arjuna, there is no destruction for this person - not here, not anywhere else. Any person who does virtuous deeds shall not fall into misfortune, my friend."],t.w)
B.Nj=new A.d(B.c,["\u092a\u094d\u0930\u093e\u092a\u094d\u092f \u092a\u0941\u0923\u094d\u092f\u0915\u0943\u0924\u093e\u0928\u094d \u0932\u094b\u0915\u093e\u0928\u094d \u0909\u0937\u093f\u0924\u094d\u0935\u093e \u0936\u093e\u0936\u094d\u0935\u0924\u0940\u0903 \u0938\u092e\u093e\u0903 \u0964\n\u0936\u0941\u091a\u0940\u0928\u093e\u092e\u094d \u0936\u094d\u0930\u0940\u092e\u0924\u093e\u092e\u094d \u0917\u0947\u0939\u0947 \u092f\u094b\u0917 \u092d\u094d\u0930\u0937\u094d\u091f\u094b\u093d\u092d\u093f\u091c\u093e\u092f\u0924\u0947 \u0965 \u096a\u0967 \u0965","A person who has started on the path to realize the Self but has slipped obtains fortunate environments, lives there for a long time and will be born to a family of open and affectionate people, who are endowed with good material comforts."],t.w)
B.S3=new A.d(B.c,["\u0905\u0925\u0935\u093e \u092f\u094b\u0917\u093f\u0928\u093e\u092e\u094d \u090f\u0935 \u0915\u0941\u0932\u0947 \u092d\u0935\u0924\u093f \u0927\u0940\u092e\u0924\u093e\u092e\u094d \u0964\n\u090f\u0924\u0926\u094d\u0927\u093f \u0926\u0941\u0930\u094d\u0932\u092d\u0924\u0930\u092e\u094d \u0932\u094b\u0915\u0947 \u091c\u0928\u094d\u092e \u092f\u0926\u0940\u0926\u0943\u0936\u092e\u094d \u0965 \u096a\u0968 \u0965","A person who slipped after going further on the path to realize the Self is born to a family of wise people who are capable of teaching, and who themselves practice the realization of the Self. This type of birth is extremely rare and difficult to get in this world."],t.w)
B.Qe=new A.d(B.c,["\u0924\u0924\u094d\u0930 \u0924\u092e\u094d \u092c\u0941\u0926\u094d\u0927\u093f\u0938\u0902\u092f\u094b\u0917\u092e\u094d \u0932\u092d\u0924\u0947 \u092a\u094c\u0930\u094d\u0935 \u0926\u0948\u0939\u093f\u0915\u092e\u094d \u0964\n\u092f\u0924\u0924\u0947 \u091a \u0924\u0924\u094b \u092d\u0942\u092f\u0903 \u0938\u092e\u094d\u0938\u093f\u0926\u094d\u0927\u094c \u0915\u0941\u0930\u0941\u0928\u0928\u094d\u0926\u0928 \u0965 \u096a\u0969 \u0965\n\u092a\u0942\u0930\u094d\u0935\u093e\u092d\u094d\u092f\u093e\u0938\u0947\u0928 \u0924\u0947\u0928\u0948\u0935 \u0939\u094d\u0930\u093f\u092f\u0924\u0947 \u0939\u094d\u092f\u0935\u0936\u094b\u093d\u092a\u093f \u0938\u0903 \u0964","Arjuna, in this birth (mentioned in the previous two Shlokas), he will regain the same knowledge of the Self, as he had in his previous body. Then, he strives for realizing the Self with greater strength. He will definitely get pulled towards the realization of the Self due to the same practice he was involved in previously, even though he has not controlled his mind to focus upon it entirely."],t.w)
B.QV=new A.d(B.c,["\u091c\u093f\u091c\u094d\u091e\u093e\u0938\u0941\u0930\u092a\u093f \u092f\u094b\u0917\u0938\u094d\u092f \u0936\u092c\u094d\u0926\u092c\u094d\u0930\u0939\u094d\u092e\u093e\u0924\u093f\u0935\u0930\u094d\u0924\u0924\u0947 \u0965 \u096a\u096a \u0965","Even a person who wants to know the nature of yoga will overcome the influence of material stimuli."],t.w)
B.QB=new A.d(B.c,["\u092a\u094d\u0930\u092f\u0924\u094d\u0928\u093e\u0924\u094d \u092f\u0924\u092e\u093e\u0928\u0938\u094d\u0924\u0941 \u092f\u094b\u0917\u0940 \u0938\u092e\u094d\u0936\u0941\u0926\u094d\u0927 \u0915\u093f\u0932\u094d\u092c\u093f\u0937\u0903 \u0964\n\u0905\u0928\u0947\u0915 \u091c\u0928\u094d\u092e \u0938\u092e\u094d\u0938\u093f\u0926\u094d\u0927\u0903 \u0924\u0924\u094b \u092f\u093e\u0924\u093f \u092a\u0930\u093e\u092e\u094d \u0917\u0924\u093f\u092e\u094d \u0965 \u096a\u096b \u0965","Hence, a person who has set out on the path to realize the Self obtains the ultimate goal accomplished over several births by persevering with efforts, having been cleaned of all flaws."],t.w)
B.P0=new A.d(B.c,["\u0924\u092a\u0938\u094d\u0935\u093f\u092d\u094d\u092f\u094b\u093d\u0927\u093f\u0915\u094b \u092f\u094b\u0917\u0940 \u091c\u094d\u091e\u093e\u0928\u093f\u092d\u094d\u092f\u094b\u093d\u092a\u093f \u092e\u0924\u094b\u093d\u0927\u093f\u0915\u0903 \u0964\n\u0915\u0930\u094d\u092e\u093f\u092c\u094d\u092f\u0903 \u091a\u093e\u0927\u093f\u0915\u094b \u092f\u094b\u0917\u0940 \u0924\u0938\u094d\u092e\u093e\u0924\u094d \u092f\u094b\u0917\u0940 \u092d\u0935\u093e\u0930\u094d\u091c\u0941\u0928 \u0965 \u096a\u096c \u0965","A person who practices yoga is higher than people who perform penance. He is considered to be higher than learned people as well. The person who practices yoga is also higher than people who work hard to get results. Hence, Arjuna, practice yoga ."],t.w)
B.Rr=new A.d(B.c,["\u092f\u094b\u0917\u093f\u0928\u093e\u092e\u094d \u0905\u092a\u093f \u0938\u0930\u094d\u0935\u0947\u0937\u093e\u092e\u094d \u092e\u0926\u094d\u0917\u0924\u0947\u0928 \u0905\u0928\u094d\u0924\u0930\u093e\u0924\u094d\u092e\u0928\u093e \u0964\n\u0936\u094d\u0930\u0926\u094d\u0927\u093e\u0935\u093e\u0928\u094d \u092d\u091c\u0924\u0947 \u092f\u094b \u092e\u093e\u092e\u094d \u0938 \u092e\u0947 \u092f\u0941\u0915\u094d\u0924\u0924\u092e\u094b \u092e\u0924\u0903 \u0965 \u096a\u096d \u0965","The person who worships Me, having placed himself within Me with complete trust, I consider him to be the most focused, even in comparison to all those who persevere to realize the Self."],t.w)
B.QT=new A.d(B.c,["\u0936\u094d\u0930\u0940 \u092d\u0917\u0935\u093e\u0928\u0941\u0935\u093e\u091a -\n\u092e\u092f\u094d\u092f\u093e\u0938\u0915\u094d\u0924 \u092e\u0928\u093e\u0903 \u092a\u093e\u0930\u094d\u0925 \u092f\u094b\u0917\u092e\u094d \u092f\u0941\u0928\u094d\u091c\u0928\u094d \u092e\u0926\u093e\u0936\u094d\u0930\u092f\u0903 \u0964\n\u0905\u0938\u092e\u094d\u0936\u092f\u092e\u094d \u0938\u092e\u0917\u094d\u0930\u092e\u094d \u092e\u093e\u092e\u094d \u092f\u0925\u093e \u091c\u094d\u091e\u093e\u0938\u094d\u092f\u0938\u093f \u0924\u0924\u094d \u0936\u0943\u0923\u0941 \u0965 \u0967 \u0965","The Lord said: Arjuna, listen to the way in which you will know me entirely without any doubt, with a mind filled with eagerness towards Me, embarking on the journey to join Me, having taken refuge in Me"],t.w)
B.V1=new A.d(B.c,["\u091c\u094d\u091e\u093e\u0928\u092e\u094d \u0924\u0947\u093d\u0939\u092e\u094d \u0938\u0935\u093f\u091c\u094d\u091e\u093e\u0928\u092e\u094d \u0907\u0926\u092e\u094d \u0935\u0915\u094d\u0937\u094d\u092f\u093e\u092e\u093f \u0905\u0936\u0947\u0937\u0924\u0903 \u0964\n\u092f\u0924\u094d \u091c\u094d\u091e\u093e\u0924\u094d\u0935\u093e \u0928\u0947\u0939 \u092d\u0942\u092f\u094b \u0905\u0928\u094d\u092f\u0924\u094d \u091c\u094d\u091e\u093e\u0924\u0935\u094d\u092f\u092e\u094d \u0905\u0935\u0936\u093f\u0937\u094d\u092f\u0924\u0947 \u0965 \u0968 \u0965","I will now tell you this knowledge along with the ability to distinguish, in completeness. After knowing this there is nothing else, which remains over here to be learnt any more."],t.w)
B.QQ=new A.d(B.c,["\u092e\u0928\u0941\u0937\u094d\u092f\u093e\u0923\u093e\u092e\u094d \u0938\u0939\u0938\u094d\u0930\u0947\u0937\u0941 \u0915\u0936\u094d\u091a\u093f\u0924\u094d \u092f\u0924\u0924\u093f \u0938\u093f\u0926\u094d\u0927\u092f\u0947 \u0964\n\u092f\u0924\u0924\u093e\u092e\u092a\u093f \u0938\u093f\u0926\u094d\u0927\u093e\u0928\u093e\u092e\u094d \u0915\u0936\u094d\u091a\u093f\u0928\u094d\u092e\u093e\u092e\u094d \u0935\u0947\u0924\u094d\u0924\u093f \u0924\u0924\u094d\u0935\u0924\u0903 \u0965 \u0969 \u0965","Among thousands of people, someone persists in his endeavor to achieve supreme knowledge. Even among those who persevere to achieve this knowledge, someone among them will know Me in My true form."],t.w)
B.UR=new A.d(B.c,["\u092d\u0942\u092e\u093f\u0930\u093e\u092a\u094b\u093d\u0928\u0932\u094b \u0935\u093e\u092f\u0941\u0903 \u0916\u092e\u094d \u092e\u0928\u094b \u092c\u0941\u0926\u094d\u0927\u093f\u0930\u0947\u0935 \u091a \u0964\n\u0905\u0939\u0919\u094d\u0915\u093e\u0930 \u0907\u0924\u0940\u092f\u092e\u094d \u092e\u0947 \u092d\u093f\u0928\u094d\u0928\u093e \u092a\u094d\u0930\u0915\u0943\u0924\u093f\u0930\u0937\u094d\u091f\u0927\u093e \u0965 \u096a \u0965","This universe of mine is divided into eight categories: Solids, liquids, gasses, energy, space, mind, the gross collections and the notion of individuality."],t.w)
B.Qi=new A.d(B.c,["\u0905\u092a\u0930\u0947\u092f\u092e\u094d \u0907\u0924\u0938\u094d\u0924\u094d\u0935\u0928\u094d\u092f\u092e\u094d \u092a\u094d\u0930\u0915\u0943\u0924\u093f\u092e\u094d \u0935\u093f\u0926\u094d\u0927\u093f \u092e\u0947 \u092a\u0930\u093e\u092e\u094d \u0964\n\u091c\u0940\u0935\u092c\u0942\u0924\u092e\u094d \u092e\u0939\u093e\u092c\u093e\u0939\u094b \u092f\u092f\u093e \u0907\u0926\u092e\u094d \u0927\u093e\u0930\u094d\u092f\u0924\u0947 \u091c\u0917\u0924\u094d \u0965 \u096b \u0965","Arjuna, the universe that I just described is not the ultimate one. Know My ultimate nature, which is something distinct from this one, in the form of a conscious being by whom this world is sustained."],t.w)
B.Od=new A.d(B.c,["\u090f\u0924\u0924\u094d \u092f\u094b\u0928\u0940\u0928\u093f \u092d\u0942\u0924\u093e\u0928\u093f \u0938\u0930\u094d\u0935\u093e\u0923\u093f \u0907\u0924\u094d\u092f\u0941\u092a\u0927\u093e\u0930\u092f \u0964\n\u0905\u0939\u092e\u094d \u0915\u0943\u0924\u094d\u0938\u094d\u0928\u0938\u094d\u092f \u091c\u0917\u0924\u0903 \u092a\u094d\u0930\u092d\u0935\u0903 \u092a\u094d\u0930\u0932\u092f\u0938\u094d\u0924\u0925\u093e \u0965 \u096c \u0965","Bear in mind that all beings owe their existence to the two natures. In this way, I am the creator and the destroyer of the entire universe."],t.w)
B.SZ=new A.d(B.c,["\u092e\u0924\u094d\u0924\u0903 \u092a\u0930\u0924\u0930\u092e\u094d \u0928\u093e\u0928\u094d\u092f\u0924\u094d \u0915\u093f\u0928\u094d\u091a\u093f\u0924\u094d \u0905\u0938\u094d\u0924\u093f \u0927\u0928\u0928\u094d\u091c\u092f \u0964\n\u092e\u092f\u093f \u0938\u0930\u094d\u0935\u092e\u094d \u0907\u0926\u092e\u094d \u092a\u094d\u0930\u094b\u0924\u092e\u094d \u0938\u0942\u0924\u094d\u0930\u0947 \u092e\u0923\u093f\u0917\u0923\u093e \u0907\u0935 \u0965 \u096d \u0965","Arjuna, there is absolutely nothing else that is beyond Me. All of this is mounted in Me just as beads are strung in a string,"],t.w)
B.Oe=new A.d(B.c,["\u0930\u0938\u094b\u093d\u0939\u092e\u094d \u0905\u092a\u094d\u0938\u0941 \u0915\u094c\u0928\u094d\u0924\u0947\u092f \u092a\u094d\u0930\u092d\u093e\u093d\u0938\u094d\u092e\u093f \u0936\u0936\u093f \u0938\u0942\u0930\u094d\u092f\u092f\u094b\u0903 \u0964\n\u092a\u094d\u0930\u0923\u0935\u0903 \u0938\u0930\u094d\u0935 \u0935\u0947\u0926\u0947\u0937\u0941 \u0936\u092c\u094d\u0926\u0903 \u0916\u0947 \u092a\u094c\u0930\u0941\u0937\u092e\u094d \u0928\u0943\u0937\u0941 \u0965 \u096e \u0965\n\u092a\u0941\u0923\u094d\u092f\u094b \u0917\u0928\u094d\u0927\u0903 \u092a\u0943\u0925\u093f\u0935\u094d\u092f\u093e\u092e\u094d \u091a \u0924\u0947\u091c\u0936\u094d\u091a \u0905\u0938\u094d\u092e\u093f \u0935\u093f\u092d\u093e\u0935\u0938\u094c \u0964\n\u091c\u0940\u0935\u0928\u092e\u094d \u0938\u0930\u094d\u0935 \u092d\u0942\u0924\u0947\u0937\u0941 \u0924\u092a\u0936\u094d\u091a\u093e\u0938\u094d\u092e\u093f \u0924\u092a\u0938\u094d\u0935\u093f\u0937\u0941 \u0965 \u096f \u0965\n\u092c\u0940\u091c\u092e\u094d \u092e\u093e\u092e\u094d \u0938\u0930\u094d\u0935 \u092d\u0942\u0924\u093e\u0928\u093e\u092e\u094d \u0935\u093f\u0926\u094d\u0927\u093f \u092a\u093e\u0930\u094d\u0925 \u0938\u0928\u093e\u0924\u0928\u092e\u094d \u0964\n\u092c\u0941\u0926\u094d\u0927\u093f \u092c\u0941\u0926\u094d\u0927\u093f\u092e\u0924\u093e\u092e\u094d \u0905\u0938\u094d\u092e\u093f \u0924\u0947\u091c\u0903 \u0924\u0947\u091c\u0938\u094d\u0935\u093f\u0928\u093e\u092e\u094d \u0905\u0939\u092e\u094d \u0965 \u0967\u0966 \u0965\n\u092c\u0932\u092e\u094d \u092c\u0932\u0935\u0924\u093e\u092e\u094d \u091a\u093e\u0939\u092e\u094d \u0915\u093e\u092e \u0930\u093e\u0917 \u0935\u093f\u0935\u0930\u094d\u091c\u093f\u0924\u092e\u094d \u0964\n\u0927\u0930\u094d\u092e \u0905\u0935\u093f\u0930\u0941\u0926\u094d\u0927\u094b \u092d\u0942\u0924\u0947\u0937\u0941 \u0915\u093e\u092e\u094b\u0938\u094d\u092e\u093f \u092d\u0930\u0924\u0930\u094d\u0937\u092d \u0965 \u0967\u0967 \u0965","Arjuna, I am the taste in all liquids, the radiance in the moon and the sun, I am the sacred syllable (Om) in all the Vedas, the waves in space, capability in humans. I am the pleasant fragrance of this Earth and the energy in a fire. I am the life in all living beings and thoughts in the people who focus their intellect. Arjuna, know Me as the primary cause of all beings, existing since beginning-less time. I am the intellect of intelligent beings, the brilliance in brilliant people. Arjuna, I am the power in powerful people, separate from desire and indulgence and I am love that does not oppose My principles in the beings of this world."],t.w)
B.NZ=new A.d(B.c,["\u092f\u0947 \u091a\u0948\u0935 \u0938\u093e\u0924\u094d\u0935\u093f\u0915\u093e \u092d\u093e\u0935\u093e \u0930\u093e\u091c\u0938\u093e\u0903 \u0924\u093e\u092e\u0938\u093e\u0936\u094d\u091a \u092f\u0947 \u0964\n\u092e\u0924\u094d\u0924 \u090f\u0935\u0947\u0924\u093f \u0924\u093e\u0928\u094d \u0935\u093f\u0926\u094d\u0927\u093f \u0928 \u0924\u094d\u0935\u0939\u092e\u094d \u0924\u0947\u0937\u0941 \u0924\u0947 \u092e\u092f\u093f \u0965 \u0967\u0968 \u0965","All these feelings of wisdom and virtue, passion and activity, ignorance and laziness - know that they originate from Me. However, I am not bound in them. They are situated in Me."],t.w)
