B.Uv=new A.d(B.c,["\u0936\u094d\u0930\u0940 \u092d\u0917\u0935\u093e\u0928\u094d \u0909\u0935\u093e\u091a -\n\u0924\u094d\u0930\u093f\u0935\u093f\u0927\u093e \u092d\u0935\u0924\u093f \u0936\u094d\u0930\u0926\u094d\u0927\u093e \u0926\u0947\u0939\u093f\u0928\u093e\u092e\u094d \u0938\u093e \u0938\u094d\u0935\u092d\u093e\u0935\u091c\u093e \u0964\n\u0938\u093e\u0924\u094d\u0924\u094d\u0935\u093f\u0915\u0940 \u0930\u093e\u091c\u0938\u0940 \u091a\u0948\u0935 \u0924\u093e\u092e\u0938\u0940 \u091a\u0947\u0924\u093f \u0924\u093e\u092e\u094d \u0936\u0943\u0923\u0941 \u0965 \u0968 \u0965","The Lord said - Those who own a body have focus of three types: serene, resourceful and lazy. It comes from their own state of being. Listen to them."],t.w)
B.S9=new A.d(B.c,["\u0938\u0924\u094d\u0935\u093e\u0928\u0941\u0930\u0942\u092a\u093e \u0938\u0930\u094d\u0935\u0938\u094d\u092f \u0936\u094d\u0930\u0926\u094d\u0927\u093e \u092d\u0935\u0924\u093f \u092d\u093e\u0930\u0924 \u0964\n\u0936\u094d\u0930\u0926\u094d\u0927\u093e\u092e\u092f\u094b \u0905\u092f\u092e\u094d \u092a\u0941\u0930\u0941\u0937\u094b \u092f\u094b \u092f\u0924\u094d \u0936\u094d\u0930\u0926\u094d\u0927\u0903 \u0938 \u090f\u0935 \u0938\u0903 \u0965 \u0969 \u0965","Arjuna, each person's focus is according to the essence of his character. This person is defined by his focus. Whoever has a focus, he is that itself."],t.w)
B.Nn=new A.d(B.c,["\u092f\u091c\u0902\u0924\u0947 \u0938\u093e\u0924\u094d\u0924\u094d\u0935\u093f\u0915\u093e \u0926\u0947\u0935\u093e\u0928\u094d \u092f\u0915\u094d\u0937 \u0930\u0915\u094d\u0937\u093e\u0902\u0938\u093f \u0930\u093e\u091c\u0938\u093e\u0903 \u0964\n\u092a\u094d\u0930\u0947\u0924\u093e\u0928\u094d \u092d\u0942\u0924\u0917\u0923\u093e\u0928\u094d \u091a\u093e\u0928\u094d\u092f\u0947 \u092f\u091c\u0928\u094d\u0924\u0947 \u0924\u093e\u092e\u0938\u093e\u0903 \u091c\u0928\u093e\u0903 \u0965 \u096a \u0965","People in whom sattva is predominant devote themselves to those who follow the Lord's instructions. People who have a predominance of rajas go behind illusive powers, which they believe will guard and protect them. Other people with tamas get devoted to the deceased spirits and other superstitions."],t.w)
B.MP=new A.d(B.c,["\u0905\u0936\u093e\u0938\u094d\u0924\u094d\u0930\u0935\u093f\u0939\u093f\u0924\u092e\u094d \u0918\u094b\u0930\u092e\u094d \u0924\u092a\u094d\u092f\u0928\u094d\u0924\u0947 \u092f\u0947 \u0924\u092a\u094b \u091c\u0928\u093e\u0903 \u0964\n\u0926\u092e\u094d\u092d\u093e\u0939\u0902\u0915\u093e\u0930 \u0938\u092e\u094d\u092f\u0941\u0915\u094d\u0924\u093e\u0903 \u0915\u093e\u092e \u0930\u093e\u0917 \u092c\u0932\u093e\u0928\u094d\u0935\u093f\u0924\u093e\u0903 \u0965 \u096b \u0965\n\u0915\u0930\u094d\u0936\u092f\u0928\u094d\u0924\u0903 \u0936\u0930\u0940\u0930\u0938\u094d\u0925\u092e\u094d \u092d\u0942\u0924\u0917\u094d\u0930\u093e\u092e\u092e\u094d \u0905\u091a\u0947\u0924\u0938\u0903 \u0964\n\u092e\u093e\u092e\u094d \u091a\u0948\u0935\u093e\u0928\u094d\u0924\u0903 \u0936\u0930\u0940\u0930\u0938\u094d\u0925\u092e\u094d \u0924\u093e\u0928\u094d \u0935\u093f\u0926\u094d\u092f\u093e\u0938\u0941\u0930 \u0928\u093f\u0936\u094d\u091a\u092f\u093e\u0928\u094d \u0965 \u096c \u0965","People who are associated with hypocrisy and arrogance find their strength in desire and pleasure. They torment themselves with awful struggle, going against My instructions in the scriptures. They attenuate the colony of elements present as the body along with Me, present as the core of the body. They are lifeless. Know them as people who have resolved to disregard My instructions."],t.w)
B.O_=new A.d(B.c,["\u0906\u0939\u093e\u0930\u0938\u094d\u0924\u094d\u0935\u092a\u093f \u0938\u0930\u094d\u0935\u0938\u094d\u092f \u0924\u094d\u0930\u093f\u0935\u093f\u0927\u094b \u092d\u0935\u0924\u093f \u092a\u094d\u0930\u093f\u092f\u0903 \u0964\n\u092f\u091c\u094d\u091e\u0903 \u0924\u092a\u0903 \u0924\u0925\u093e \u0926\u093e\u0928\u092e\u094d \u0924\u0947\u0937\u093e\u092e\u094d \u092d\u0947\u0926\u092e\u094d \u0907\u092e\u092e\u094d \u0936\u0943\u0923\u0941 \u0965 \u096d \u0965","Everyone\u2019s favorite food also falls into three categories. Same is the case with worship, discipline and charity. Listen to the distinctions between them."],t.w)
B.UJ=new A.d(B.c,["\u0906\u092f\u0941\u0903 \u0938\u0924\u094d\u0935 \u092c\u0932\u093e\u0930\u094b\u0917\u094d\u092f \u0938\u0941\u0916 \u092a\u094d\u0930\u0940\u0924\u093f \u0935\u093f\u0935\u0930\u094d\u0927\u0928\u0903 \u0964\n\u0930\u0938\u094d\u092f\u093e\u0903 \u0938\u094d\u0928\u093f\u0917\u094d\u0927\u093e\u0903 \u0938\u094d\u0925\u093f\u0930\u093e \u0939\u0943\u0926\u094d\u092f\u093e \u0906\u0939\u093e\u0930\u093e\u0903 \u0938\u093e\u0924\u094d\u0924\u094d\u0935\u093f\u0915 \u092a\u094d\u0930\u093f\u092f\u093e\u0903 \u0965 \u096e \u0965","The favorite food of people in the sattva quality enhances longevity; it enhances the mind, its strength, health, well-being and love. They are tasty, being mild and smooth, preserving and provide comfort to the mind."],t.w)
B.NE=new A.d(B.c,["\u0915\u091f\u094d\u0935\u092e\u094d\u0932 \u0932\u0935\u0923 \u0905\u0924\u094d\u092f\u0941\u0937\u094d\u0923 \u0924\u0940\u0915\u094d\u0937\u094d\u0923 \u0930\u0942\u0915\u094d\u0937 \u0935\u093f\u0926\u093e\u0939\u093f\u0928\u0903 \u0964\n\u0906\u0939\u093e\u0930\u093e \u0930\u093e\u091c\u0938\u0938\u094d\u092f \u0907\u0937\u094d\u091f\u093e \u0926\u0941\u0903\u0916 \u0936\u094b\u0915\u093e\u092e\u092f \u092a\u094d\u0930\u0926\u093e\u0903 \u0965 \u096f \u0965","The favorite foods of a person in rajas are those that are difficult, giving distress and indigestion. They are pungent, sour, salty, full of heat, sharp and rough to the taste, having scorching effects."],t.w)
B.OF=new A.d(B.c,["\u092f\u093e\u0924\u092f\u093e\u092e\u092e\u094d \u0917\u0924\u0930\u0938\u092e\u094d \u092a\u0942\u0924\u093f \u092a\u0930\u094d\u092f\u0941\u0937\u093f\u0924\u092e\u094d \u091a \u092f\u0924\u094d \u0964\n\u0909\u091a\u094d\u091b\u093f\u0937\u094d\u091f\u092e\u094d \u0905\u092a\u093f \u091a\u093e\u092e\u0947\u0927\u094d\u092f\u092e\u094d \u092d\u094b\u091c\u0928\u092e\u094d \u0924\u093e\u092e\u0938 \u092a\u094d\u0930\u093f\u092f\u092e\u094d \u0965 \u0967\u0966 \u0965","Creatures that are in tamas like to eat food that is aged, having lost its natural flavor, foul-smelling, stale, even left-over fragments and other dirty things."],t.w)
B.UH=new A.d(B.c,["\u0905\u092b\u0932\u093e\u0915\u093e\u0902\u0915\u094d\u0937\u093f\u092d\u093f\u0903 \u092f\u091c\u094d\u091e\u094b \u0935\u093f\u0927\u093f \u0926\u0943\u0937\u094d\u091f\u094b \u092f \u0907\u091c\u094d\u092f\u0924\u0947 \u0964\n\u092f\u0937\u094d\u091f\u0935\u094d\u092f\u092e\u094d \u090f\u0935\u0947\u0924\u093f \u092e\u0928\u0903 \u0938\u092e\u093e\u0927\u093e\u092f \u0938 \u0938\u093e\u0924\u094d\u0935\u093f\u0915\u0903 \u0965 \u0967\u0967 \u0965","The worship that is offered in devotion, devoid of expectations, done with consideration to the methods in the scriptures, with the mind being content that 'I just need to worship' - This worship is in sattva ."],t.w)
B.M_=new A.d(B.c,["\u0905\u092d\u093f\u0938\u0902\u0927\u093e\u092f \u0924\u0941 \u092b\u0932\u092e\u094d \u0926\u092e\u094d\u092d\u093e\u0930\u094d\u0925\u092e\u094d \u0905\u092a\u093f \u091a\u0948\u0935 \u092f\u0924\u094d \u0964\n\u0907\u091c\u094d\u092f\u0924\u0947 \u092d\u0930\u0924 \u0936\u094d\u0930\u0947\u0937\u094d\u0920 \u0924\u092e\u094d \u092f\u091c\u094d\u091e\u092e\u094d \u0935\u093f\u0926\u094d\u0927\u093f \u0930\u093e\u091c\u0938\u092e\u094d \u0965 \u0967\u0968 \u0965","Arjuna, worship that is performed with attachment towards expectations or even just to show-off - know that to be in the quality of rajas ."],t.w)
B.Ob=new A.d(B.c,["\u0935\u093f\u0927\u093f\u0939\u0940\u0928\u092e\u094d \u0905\u0938\u0943\u0937\u094d\u091f\u093e\u0928\u094d\u0928\u092e\u094d \u092e\u0928\u094d\u0924\u094d\u0930\u0939\u0940\u0928\u092e\u094d \u0905\u0926\u0915\u094d\u0937\u093f\u0923\u092e\u094d \u0964\n\u0936\u094d\u0930\u0926\u094d\u0927\u093e \u0935\u093f\u0930\u0939\u093f\u0924\u092e\u094d \u092f\u091c\u094d\u091e\u092e\u094d \u0924\u093e\u092e\u0938\u092e\u094d \u092a\u0930\u093f\u091a\u0915\u094d\u0937\u0924\u0947 \u0965 \u0967\u0969 \u0965","A ritual that disregards all methods with inappropriate materials, devoid of prayer and offering done without focus is condemned to be in the quality of tamas ."],t.w)
B.Qh=new A.d(B.c,["\u0926\u0947\u0935 \u0926\u094d\u0935\u093f\u091c \u0917\u0941\u0930\u0941 \u092a\u094d\u0930\u093e\u091c\u094d\u091e \u092a\u0942\u091c\u0928\u092e\u094d \u0936\u094c\u091a\u092e\u094d \u0906\u0930\u094d\u091c\u0935\u092e\u094d \u0964\n\u092c\u094d\u0930\u0939\u094d\u092e\u091a\u0930\u094d\u092f\u092e\u094d \u0905\u0939\u093f\u0902\u0938\u093e \u091a \u0936\u093e\u0930\u0940\u0930\u092e\u094d \u0924\u092a \u0909\u091a\u094d\u092f\u0924\u0947 \u0965 \u0967\u096a \u0965","Respecting the divine, the student, the teacher and those who know; being clean; being true to yourself; being immaculate; without the intention of causing harm - these are called the discipline of the body."],t.w)
B.Uq=new A.d(B.c,["\u0905\u0928\u0941\u0926\u094d\u0935\u0947\u0917\u0915\u0930\u092e\u094d \u0935\u093e\u0915\u094d\u092f\u092e\u094d \u0938\u0924\u094d\u092f\u092e\u094d \u092a\u094d\u0930\u093f\u092f \u0939\u093f\u0924\u092e\u094d \u091a \u092f\u0924\u094d \u0964\n\u0938\u094d\u0935\u093e\u0927\u094d\u092f\u093e\u092f\u093e\u092d\u094d\u092f\u0938\u0928\u092e\u094d \u091a\u0948\u0935 \u0935\u093e\u0915\u094d \u092e\u092f\u092e\u094d \u0924\u092a \u0909\u091a\u094d\u092f\u0924\u0947 \u0965 \u0967\u096b \u0965","A sentence that doesn't cause agitation, is authentic, liked and comforting, with a study of the Self built into it - this is known as discipline of speech."],t.w)
B.Ox=new A.d(B.c,["\u092e\u0928\u0903 \u092a\u094d\u0930\u0938\u093e\u0926\u0903 \u0938\u094c\u092e\u094d\u092f\u0924\u094d\u0935\u092e\u094d \u092e\u094c\u0928\u092e\u094d \u0906\u0924\u094d\u092e \u0935\u093f\u0928\u093f\u0917\u094d\u0930\u0939\u0903 \u0964\n\u092d\u093e\u0935 \u0938\u0902\u0936\u0941\u0926\u094d\u0927\u093f\u0903 \u0907\u0924\u093f \u090f\u0924\u0924\u094d \u0924\u092a\u094b \u092e\u093e\u0928\u0938\u092e\u094d \u0909\u091a\u094d\u092f\u0924\u0947 \u0965 \u0967\u096c \u0965","A pleasant mind, pleased with the good fortune of others, keeping the organ of speech under control, stationing the mind in the object of concentration, a clean state of being - this is called as the discipline of the mind."],t.w)
B.NR=new A.d(B.c,["\u0936\u094d\u0930\u0926\u094d\u0927\u092f\u093e \u092a\u0930\u092f\u093e \u0924\u092a\u094d\u0924\u092e\u094d \u0924\u092a\u0903 \u0924\u0924\u094d \u0924\u094d\u0930\u093f\u0935\u093f\u0927\u092e\u094d \u0928\u0930\u0948\u0903 \u0964\n\u0905\u092b\u0932\u093e\u0915\u093e\u0902\u0915\u094d\u0937\u093f\u092d\u093f\u0903 \u092f\u0941\u0915\u094d\u0924\u0948\u0903 \u0938\u093e\u0924\u094d\u0935\u093f\u0915\u092e\u094d \u092a\u0930\u093f\u091a\u0915\u094d\u0937\u0924\u0947 \u0965 \u0967\u096d \u0965","When these three disciplines are implemented as The Lord's worship, by people with supreme focus, without being bogged down by expectations, - this is seen as being in the quality of sattva ."],t.w)
B.SW=new A.d(B.c,["\u0938\u0924\u094d\u0915\u093e\u0930 \u092e\u093e\u0928 \u092a\u0942\u091c\u093e\u0930\u094d\u0925\u092e\u094d \u0924\u092a\u094b \u0926\u092e\u094d\u092d\u0947\u0928 \u091a\u0948\u0935 \u092f\u0924\u094d \u0964\n\u0915\u094d\u0930\u093f\u092f\u0924\u0947 \u0924\u0924\u094d \u0907\u0939 \u092a\u094d\u0930\u094b\u0915\u094d\u0924\u092e\u094d \u0930\u093e\u091c\u0938\u092e\u094d \u091a\u0932\u092e\u094d \u0905\u0927\u094d\u0930\u0941\u0935\u092e\u094d \u0965 \u0967\u096e \u0965","Discipline that's practiced to be revered, to gain fame, respect, pride and with the only aim of showing-off - such discipline here is said to be in the quality of rajas . It is perishable and unstable."],t.w)
B.LL=new A.d(B.c,["\u092e\u0942\u0922 \u0917\u094d\u0930\u093e\u0939\u0947\u0923 \u0906\u0924\u094d\u092e\u0928\u094b \u092f\u0924\u094d \u092a\u0940\u0921\u092f\u093e \u0915\u094d\u0930\u093f\u092f\u0924\u0947 \u0924\u092a\u0903 \u0964\n\u092a\u0930\u0938\u094d\u092f\u094b\u0924\u094d\u0938\u093e\u0926\u0928\u093e\u0930\u094d\u0925\u092e\u094d \u0935\u093e \u0924\u0924\u094d \u0924\u093e\u092e\u0938\u092e\u094d \u0909\u0926\u093e\u0939\u0943\u0924\u092e\u094d \u0965 \u0967\u096f \u0965","Discipline that's practiced with confused perceptions to torment oneself, or practiced in order to put aside others - such discipline is said to be in the quality of tamas ."],t.w)
B.Nm=new A.d(B.c,["\u0926\u093e\u0924\u0935\u094d\u092f\u092e\u094d \u0907\u0924\u093f \u092f\u0924\u094d \u0926\u093e\u0928\u092e\u094d \u0926\u0940\u092f\u0924\u0947 \u0905\u0928\u0941\u092a\u0915\u093e\u0930\u093f\u0923\u0947 \u0964\n\u0926\u0947\u0936\u0947 \u0915\u093e\u0932\u0947 \u091a \u092a\u093e\u0924\u094d\u0930\u0947 \u091a \u0924\u0924\u094d \u0926\u093e\u0928\u092e\u094d \u0938\u093e\u0924\u094d\u0935\u093f\u0915\u092e\u094d \u0938\u094d\u092e\u0943\u0924\u092e\u094d \u0965 \u0968\u0966 \u0965","Possessions that are given to the deserving who have not been of favor or assistance, at the appropriate place and time, with conviction - This charity is known to be in the quality of sattva ."],t.w)
B.SQ=new A.d(B.c,["\u092f\u0924\u094d\u0924\u0941 \u092a\u094d\u0930\u0924\u094d\u092f\u0941\u092a\u0915\u093e\u0930\u093e\u0930\u094d\u0925\u092e\u094d \u092b\u0932\u092e\u094d \u0909\u0926\u094d\u0926\u093f\u0936\u094d\u092f \u0935\u093e \u092a\u0941\u0928\u0903 \u0964\n\u0926\u0940\u092f\u0924\u0947 \u091a \u092a\u0930\u093f\u0915\u094d\u0932\u093f\u0937\u094d\u091f\u092e\u094d \u0924\u0924\u094d \u0926\u093e\u0928\u092e\u094d \u0930\u093e\u091c\u0938\u092e\u094d \u0938\u094d\u092e\u0943\u0924\u092e\u094d \u0965 \u0968\u0967 \u0965","On the other hand, when it is given as return for past favors or in anticipation of future favors, or again, targeting expectations, it is done unwillingly, with trouble and exhaustion. This act of giving is known to be in the quality of rajas ."],t.w)
B.S5=new A.d(B.c,["\u0905\u0926\u0947\u0936\u0915\u093e\u0932\u0947 \u092f\u0924\u094d \u0926\u093e\u0928\u092e\u094d \u0905\u092a\u093e\u0924\u094d\u0930\u0947\u092d\u094d\u092f\u0903 \u091a \u0926\u0940\u092f\u0924\u0947 \u0964\n\u0905\u0938\u0924\u094d\u0915\u0943\u0924\u092e\u094d \u0905\u0935\u091c\u094d\u091e\u093e\u0924\u092e\u094d \u0924\u0924\u094d \u0924\u093e\u092e\u0938\u092e\u094d \u0909\u0926\u093e\u0939\u0943\u0924\u092e\u094d \u0965 \u0968\u0968 \u0965","That which is given to the undeserving, without an appropriate place and time without respect, with contempt, it is said to be in the quality of tamas ."],t.w)
B.LN=new A.d(B.c,["\u0913\u092e\u094d \u0924\u0924\u094d \u0938\u0924\u094d \u0907\u0924\u093f \u0928\u093f\u0930\u094d\u0926\u0947\u0936\u094b \u092c\u094d\u0930\u0939\u094d\u092e\u0923\u0903 \u0924\u094d\u0930\u093f\u0935\u093f\u0927\u0903 \u0938\u094d\u092e\u0943\u0924\u0903 \u0964\n\u092c\u094d\u0930\u093e\u0939\u094d\u092e\u0923\u093e\u0903 \u0924\u0947\u0928 \u0935\u0947\u0926\u093e\u0936\u094d\u091a \u092f\u091c\u094d\u091e\u093e\u0903 \u091a \u0935\u093f\u0939\u093f\u0924\u093e\u0903 \u092a\u0941\u0930\u093e \u0965 \u0968\u0969 \u0965","'Om', 'tat', 'sat' are three specific directives, prescribed for all activities in the Lord's scriptures. The Vedas, people in the quest for the Lord and the way of worship were specified long ago with these sounds."],t.w)
