B.Vf=new A.d(B.c,["\u0924\u0926\u093f\u0924\u093f \u0905\u0928\u092d\u093f\u0938\u0928\u094d\u0927\u093e\u092f \u092b\u0932\u092e\u094d \u092f\u091c\u094d\u091e \u0924\u092a\u0903 \u0915\u094d\u0930\u093f\u092f\u093e\u0903 \u0964\n\u0926\u093e\u0928\u0915\u094d\u0930\u093f\u092f\u093e\u0903 \u091a \u0935\u093f\u0935\u093f\u0927\u093e\u0903 \u0915\u094d\u0930\u093f\u092f\u0928\u094d\u0924\u0947 \u092e\u094b\u0915\u094d\u0937 \u0915\u093e\u0902\u0915\u094d\u0937\u093f\u092d\u093f\u0903 \u0965 \u0968\u096b \u0965","Activities in the form of worship, discipline and various kinds of charitable deeds are done without being bogged down by expectations by those who desire moksha , saying the word 'tat'."],t.w)
