B.UP=new A.d(B.c,["\u0905\u0930\u094d\u091c\u0941\u0928 \u0909\u0935\u093e\u091a -\n\u0938\u0902\u0928\u094d\u092f\u093e\u0938\u0938\u094d\u092f \u092e\u0939\u093e\u092c\u093e\u0939\u094b \u0924\u0924\u094d\u0924\u094d\u0935\u092e\u094d \u0907\u091a\u094d\u091b\u093e\u092e\u093f \u0935\u0947\u0926\u093f\u0924\u0941\u092e\u094d \u0964\n\u0924\u094d\u092f\u093e\u0917\u0938\u094d\u092f \u091a \u0939\u0943\u0937\u0940\u0915\u0947\u0936 \u092a\u0943\u0925\u0915\u094d \u0915\u0947\u0936\u093f \u0928\u093f\u0937\u0942\u0926\u0928 \u0965 \u0967 \u0965","Arjuna said - I would like to know the true nature of renunciation, as well as the true nature of 'letting go' distinctly. O Lord, you are the Self in everything, controlling all, you have mighty arms, you have destroyed Keshi."],t.w)
B.O4=new A.d(B.c,["\u0936\u094d\u0930\u0940 \u092d\u0917\u0935\u093e\u0928\u094d \u0909\u0935\u093e\u091a -\n\u0915\u093e\u092e\u094d\u092f\u093e\u0928\u093e\u092e\u094d \u0915\u0930\u094d\u092e\u0923\u093e\u092e\u094d \u0928\u094d\u092f\u093e\u0938\u092e\u094d \u0938\u0902\u0928\u094d\u092f\u093e\u0938\u092e\u094d \u0915\u0935\u092f\u094b \u0935\u093f\u0926\u0941\u0903 \u0964\n\u0938\u0930\u094d\u0935 \u0915\u0930\u094d\u092e \u092b\u0932 \u0924\u094d\u092f\u093e\u0917\u092e\u094d \u092a\u094d\u0930\u093e\u0939\u0941\u0903 \u0924\u094d\u092f\u093e\u0917\u092e\u094d \u0935\u093f\u091a\u0915\u094d\u0937\u0923\u093e\u0903 \u0965 \u0968 \u0965","The Lord said - The wise know that renunciation is to leave actions that come from desire. Those who are experienced say that 'letting go' is about giving up expectation in all actions."],t.w)
B.R7=new A.d(B.c,["\u0924\u094d\u092f\u093e\u091c\u094d\u092f\u092e\u094d \u0926\u094b\u0937\u0935\u0924\u094d \u0907\u0924\u094d\u092f\u0947\u0915\u0947 \u0915\u0930\u094d\u092e \u092a\u094d\u0930\u093e\u0939\u0941\u0903 \u092e\u0928\u0940\u0937\u094d\u0923\u0903 \u0964\n\u092f\u091c\u094d\u091e \u0926\u093e\u0928 \u0924\u092a\u0903 \u0915\u0930\u094d\u092e \u0928 \u0924\u094d\u092f\u093e\u091c\u094d\u092f\u092e\u094d \u0907\u0924\u093f \u091a\u093e\u092a\u0930\u0947 \u0965 \u0969 \u0965","Some people say that we need to leave actions, since flaws are inherent in them. Others say that actions of worship, charity and discipline are not to be given up."],t.w)
