B.OE=new A.d(B.c,["\u0928\u093f\u092f\u0924\u0938\u094d\u092f \u0924\u0941 \u0938\u0902\u0928\u094d\u092f\u093e\u0938\u0903 \u0915\u0930\u094d\u092e\u0923\u0903 \u0928\u094b\u092a\u092a\u0926\u094d\u092f\u0924\u0947 \u0964\n\u092e\u094b\u0939\u093e\u0924\u094d \u0924\u0938\u094d\u092f \u092a\u0930\u093f\u0924\u094d\u092f\u093e\u0917\u0903 \u0924\u093e\u092e\u0938\u0903 \u092a\u0930\u093f\u0915\u0940\u0930\u094d\u0924\u093f\u0924\u0903 \u0965 \u096d \u0965","On the other hand, the renunciation of routine, prescribed activities is not appropriate. Giving them up in confusion is said to be in the quality of tamas ."],t.w)
